(1, 'Home', 'Trang chủ', '<p><br></p>', '', '', 'vn', 1),
(2, 'participation', 'Cách thức tham gia', '<p>Để tham gia chương trình khuyến mại, trước tiên, khách hàng cần đăng ký gói“Văn hóa”, Có 2 cách đăng ký như sau:</p>\r\n<p class="well" style="color: #ff0b2c;">&nbsp; &nbsp; &nbsp; &nbsp;- Kênh SMS Bước 1 soạn tin: DK gửi 678, Bước 2: soạn OK để xác nhận</p>\r\n<p class="well" style="color: #ff0b2c;">&nbsp; &nbsp; &nbsp; &nbsp;- Kênh ussd bấm: *678# (nhấn núi gọi). Sau đó nhấn 1 và gửi để đăng kí hoặc bấm *678*1# (nhấn nút gọi)</p>\r\n<p>Sau khi đăng ký thành công gói “Văn hóa”, khách hàng tham gia gói “Du lịch” bằng cách soạn <strong>GO</strong> gửi <strong>678</strong>.</p>\r\n<p>Kênh wapsite, Gói Văn hóa :</p>\r\n<p class="well" style="color: #ff0b2c;">&nbsp; &nbsp; &nbsp; &nbsp;- Bước 1: Khách hàng bấm vào các banner quảng cáo về CTKM</p>\r\n<p class="well" style="color: #ff0b2c;">&nbsp; &nbsp; &nbsp; &nbsp;- Bước 2: Khách hàng bấm đồng ý trên trang xác thực MobiFone <a href="http://dangky.mobifone.vn" target="_blank">http://dangky.mobifone.vn</a></p>', '', '', 'vn', 1),
