(10, 'terms', 'Lộc Vàng Xuân Mới', '<ol>\r\n<li><strong>Tên</strong><strong> chương trình Lộc vàng đón xuân – Giai đoạn 2: </strong>Lộc vàng xuân mới</li>\r\n<li><strong>Thời</strong><strong> gian triển khai: <br> </strong> Từ 15h00 ngày 22/02/2016 đến hết 23h59:59 ngày 21/05/2016 (90 ngày).</li>\r\n<li><strong>Gói dịch vụ cung cấp:</strong> Gói Văn hóa và gói Du xuân.</li>\r\n<li><strong>Đầu số: </strong>678</li>\r\n<li><strong>Website dịch vụ: </strong>{cache}</li>\r\n<li><strong>Phạm vi khuyến mại: </strong>Toàn quốc</li>\r\n<li><strong>Đối tượng và quy định </strong>\r\n<ul>\r\n<li>Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:</li>\r\n</ul>\r\n<ol>\r\n<ul>\r\n<li>Các thuê bao có tham gia chương trình khuyến mại Lộc vàng đón xuân – Giai đoạn 1</li>\r\n<li>Các thuê bao đăng ký mới gói Văn hóa và gói Du xuân từ ngày 22/02/2016</li>\r\n</ul>\r\n</ol></li>\r\n<ul>\r\n<li>Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ul>\r\n<li><strong>Cơ cấu giải thưởng: </strong>\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tên giải</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giá trị</strong><br> <strong>(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tần suất</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thành tiền</strong><br> <strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giải hiện vật</p>\r\n</td>\r\n<td>\r\n<p>Xe Mercedes C200 Model 2015</p>\r\n</td>\r\n<td>\r\n<p align="right">1.500.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">01</p>\r\n</td>\r\n<td>\r\n<p align="center">01 giải/90 ngày</p>\r\n</td>\r\n<td>\r\n<p align="right">1.500.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Giải nhì</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="right">60.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">01</p>\r\n</td>\r\n<td>\r\n<p align="center">01 giải/90 ngày</p>\r\n</td>\r\n<td>\r\n<p align="right">60.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Giải ngày</p>\r\n</td>\r\n<td>\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p align="right">100.000</p>\r\n</td>\r\n<td>\r\n<p align="center">90</p>\r\n</td>\r\n<td>\r\n<p align="center">01 giải/ngày</p>\r\n</td>\r\n<td>\r\n<p align="right">9.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n</td>\r\n<td colspan="3">\r\n<p align="center"><strong>Tổng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>92</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n</td>\r\n<td>\r\n<p align="right"><strong>1.569.000.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align="right"><em>(Bằng chữ: Một tỷ, năm trăm sáu mươi chín triệu đồng)</em></p>\r\n</li>\r\n<li><strong>Cách tham gia:</strong>\r\n<ul>\r\n<li><em>9.1 Với các thuê bao tham gia CTKM&nbsp; Lộc vàng đón xuân – Giai đoạn 1 ngày 15/02/2016:</em>\r\n<ul>\r\n<li>Nếu khách hàng không thực hiện hủy, chương trình sẽ gia hạn các gói cước Văn hóa hoặc Du xuân mà không cần đăng ký lại. Chương trình sẽ nhắn tin thông báo về việc gia hạn CTKM Lộc vàng đón xuân và các quyền lợi kèm theo.</li>\r\n<li>Nội dung nhắn tin thông báo:\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Đối tượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Nội dung</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tần suất</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">01</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Thuê bao tham gia CTKM Lộc <br> vàng đón xuân ngày 15/02/2016</p>\r\n</td>\r\n<td>\r\n<p><strong>Ngày 01:</strong><em> CTKM Loc vang don xuan giai doan 1 da ket thuc ngay 15/02/2016 va duoc tiep tuc gia han tu ngay 22/02/2016, <br> voi goi Van hoa(6.000d/ngay); goi Du xuan (3.000d/ngay) cung co hoi trung thuong Xe oto Mercedes 1,5 ty d. De huy, soan HUY gui 678. <br> Chi tiet goi 9090</em></p>\r\n</td>\r\n<td>\r\n<p>01 lần/thuê bao</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">02</p>\r\n</td>\r\n<td>\r\n<p><strong>Ngày 02:</strong><em> CTKM Loc vang don xuan giai doan 1 da ket thuc ngay 15/02/2016 va duoc tiep tuc gia han tu ngay 22/02/2016, <br> voi goi Van hoa(6.000d/ngay); goi Du xuan (3.000d/ngay) cung co hoi trung thuong Xe oto Mercedes 1,5 ty d. De huy, soan HUY gui 678.<br> Chi tiet goi 9090</em></p>\r\n</td>\r\n<td>\r\n<p>01 lần/thuê bao</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</li>\r\n<li><em>9.2 Với các thuê bao đăng ký mới:</em><br> Để tham gia CTKM, khách hàng thực hiện đăng ký các gói cước như sau:\r\n<ul>\r\n<li>Gói Văn hóa: Soạn DK hoặc VH hoặc OK gửi 678</li>\r\n<li>Gói Du xuân: Soạn GO hoặc VIP hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.</li>\r\n<li>Sau khi đăng ký thành công, nếu khách hàng không thực hiện hủy, chương trình sẽ thực hiện gia hạn hàng ngày các gói cước.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</li>\r\n<li><strong>Thông tin chi tiết về gói Văn hóa:</strong>\r\n<ul>\r\n<li><strong>Nội dung gói: </strong>Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</li>\r\n<li><strong>Quyền lợi hàng ngày:</strong>\r\n<ul>\r\n<li>Khách hàng được nhận bản tin của gói cước hàng ngày.</li>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n<li>Điểm thưởng được quy đổi ra mã dự thưởng, mã dự thưởng dùng để quay số các giải thưởng của chương trình.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Các câu hỏi của gói:</strong>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ được nhận <strong>05 câu hỏi trắc nghiệm</strong> liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi hoàn toàn miễn phí</li>\r\n<li>Câu hỏi của chương trình gồm 2 lựa chọn: Đúng hoặc Sai.&nbsp; Đáp án của chương trình đưa ra nhằm mục đích trả lời cho câu hỏi, không phụ thuộc vào câu trả lời của người tham gia.<br> <br> <em>Ví dụ: Tet nguyen dan cua nuoc ta con co ten goi khac la Tet duong lich, dung hay sai? 1=Dung 2 = Sai&nbsp;?</em><br> <em>Khi người chơi trả lời 1 hoặc 2 đều nhận được câu trả lời DAP AN: Sai, với ý nghĩa phương án số 2 (SAI) là đáp án chính xác.</em></li>\r\n</ul>\r\n</li>\r\n<li><strong>Quy định về điểm tích lũy gói Văn hóa:</strong>\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Gia hạn gói cước thành công trong ngày 22/02/2016 <br> từ CTKM Lộc vàng đón xuân – Giai đoạn 1</p>\r\n</td>\r\n<td>\r\n<p align="center">2.000 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Đă