er">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thôngtin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n<li>Trường hợp thuê bao đứng tên tổ chức:\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center"><em>&nbsp;</em></p>\r\n</td>\r\n<td>\r\n<p><em>Nếu khách hàng trúng giải bằng tiền, cần bổ sung các giấy tờ sau</em></p>\r\n</td>\r\n<td>\r\n<p><em>&nbsp;</em></p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thôngtin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n<li>Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">&nbsp;</p>\r\n<p align="center">2</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng công ty Viễn thông MobiFone.</li>\r\n<li>Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).</li>\r\n<li>Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.</li>\r\n<li>Thời hạn cuối cùng Công ty Cổ phần dịch vụ kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n</ul>\r\n</li>\r\n<li><strong>Trách nhiệm thông báo:</strong>\r\n<ul>\r\n<li>Công ty Cổ phần dịch vụ kỹ thuật MobiFone sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại, danh sách khách hàng trúng thưởng trên website chính thức của MobiFone và website của chương trình.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Các quy định khác:</strong>\r\n<ul>\r\n<li>Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.</li>\r\n<li>Công ty cổ phần dịch vụ kỹ thuật MobiFone và Tổng công ty Viễn thông MobiFone chỉ có trách nhiệm bàn giao giải thưởng hiện vật tại địa điểm chỉ định. Khách hàng trúng thưởng giải hiện vật phải chịu mọi chi phí trong việc vận chuyển giải thưởng từ địa điểm nhận giải thưởng đến địa điểm khách hàng mong muốn.</li>\r\n<li>Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.</li>\r\n<li>Công ty Cổ phần dịch vụ kỹ thuật MobiFone và Tổng công ty Viễn thông MobiFone được toàn quyền sử dụng tên và hình ảnh của khách hàng trúng giải cho mục đích quảng cáo thương mại mà không phải trả chi phí.</li>\r\n<li>Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần dịch vụ kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</li>\r\n<li>Đối với những giải thưởng không có người trúng thưởng, Công ty Cổ phần dịch vụ kỹ thuật MobiFone phải có trách nhiệm trích nộp 50% giá trị đã công bố của giải thưởng đó vào ngân sách nhà nước theo quy định tại khoản 4 điều 96 Luật Thương mại.</li>\r\n</ul>\r\n</li>\r\n</ol>', '', '', 'vn', 1);
INSERT INTO `cms_pages` (`id`, `slug`, `title`, `content`, `meta_keywords`, `meta_description`, `lang`, `enabled`) VALUES
(11, 'terms_1', 'Rinh Lộc Phát Tài', '<p><strong>1. Tên chương trình: </strong> Rinh lộc phát tài</p>\r\n<p><strong>2. Thời gian triển khai: </strong> Từ 15h00 ngày 07/06/2016 đến 23h59:59 ngày 04/09/2016</p>\r\n<p><strong>3. Hàng hóa, dịch vụ áp dụng khuyến mại:</strong> Gói Văn hóa và gói Du lịch.</p>\r\n<p><strong>4. Đầu số: </strong> 678</p>\r\n<p><strong>5. Website dịch vụ: </strong> {cache}</p>\r\n<p><strong>6. Phạm vi khuyến mại: </strong> Toàn quốc</p>\r\n<p><strong>7. Đối tượng tham gia:</strong></p>\r\n<ul>\r\n<li>Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:\r\n<ul>\r\n<li>Các thuê bao có tham gia chương trình khuyến mại Lộc vàng đón xuân – Giai đoạn 2</li>\r\n<li>Các thuê bao lần đầu đăng ký gói Văn hóa và gói Du lịch từ ngày 07/06/2016</li>\r\n</ul>\r\n</li>\r\n<li>Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ul>\r\n<p><strong>8. Cơ cấu giải thưởng: </strong></p>\r\n<div class="table-">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tên giải</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giá trị(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thành tiền(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giải tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="center">Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="center">100.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">03</p>\r\n</td>\r\n<td>\r\n<p align="center">300.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Giải thẻ cào</p>\r\n</td>\r\n<td>\r\n<p align="center">Thẻ cào</p>\r\n</td>\r\n<td>\r\n<p align="center">100.000</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">90.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td colspan="3">\r\n<p align="center"><strong>Tổng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>903</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>390.000.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p align="right"><em>(Bằng chữ: Ba trăm chín mươi triệu đồng./.)</em></p>\r\n<p><strong>9. Cách tham gia:</strong></p>\r\n<p><strong><em>9.1. </em></strong> <em>Với các thuê bao tham gia CTKM Lộc vàng đón xuân – Giai đoạn 2 ngày 21/05/2016:</em></p>\r\n<ul>\r\n<li>Nếu khách hàng không thực hiện hủy, chương trình sẽ gia hạn các gói cước Văn hóa hoặc Du lịch mà không cần đăng ký lại. Chương trình sẽ nhắn tin thông báo về việc triển khai CTKM Rinh lộc phát tài và các quyền lợi kèm theo.</li>\r\n</ul>\r\n<p><strong><em>9.2. </em></strong> <em>Với các thuê bao đăng ký mới:</em></p>\r\n<p>Để tham gia CTKM, khách hàng thực hiện đăng ký các gói cước như sau:</p>\r\n<ul>\r\n<li>Gói Văn hóa: Soạn DK hoặc VH hoặc OK gửi 678</li>\r\n<li>Gói Du lịch: Soạn GO hoặc VIP hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.</li>\r\n<li>Sau khi đăng ký thành công, nếu khách hàng không thực hiện hủy, chương trình sẽ thực hiện gia hạn hàng ngày các gói cước.</li>\r\n</ul>\r\n<p><strong>10. Thông tin chi tiết về gói Văn hóa:</strong></p>\r\n<ul>\r\n<li><strong>Nội dung gói: </strong> Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</li>\r\n<li><strong>Quyền lợi hàng ngày:</strong>\r\n<ul>\r\n<li>Khách hàng được nhận bản tin của gói cước hàng ngày.</li>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Các câu hỏi của gói:</strong>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ được nhận <strong>05 câu hỏi trắc nghiệm</strong> liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi hoàn toàn miễn phí</li>\r\n<li>Câu hỏi của chương trình gồm 2 lựa chọn: Đúng hoặc Sai. Đáp án của chương trình đưa ra nhằm mục đích trả lời cho câu hỏi, không phụ thuộc vào câu trả lời của người tham gia. <br> <em>Ví dụ: Tet nguyen dan cua nuoc ta con co ten goi khac la Tet duong lich, dung hay sai? 1=Dung 2 = Sai ?</em><br> <em> Khi khách hàng trả lời sẽ nhận được phản hồi “Tra loi DUNG” hoặc “Tra loi SAI”, với ý nghĩa: “Tra loi DUNG” nghĩa là đáp án của người chơi đưa ra là ĐÚNG theo đáp án của câu hỏi, “Tra loi SAI” nghĩa là đáp án của người chơi đưa ra là SAI so với đáp án của câu hỏi. </em></li>\r\n</ul>\r\n</li>\r\n<li><strong>Quy định về điểm tích lũy gói Văn hóa:</strong>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>I</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p><strong>Áp dụng với các thuê bao có sử dụng gói cước ngày 21/05/2016</strong></p>\r\n</td>\r\n<td valign="top">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Gia hạn gói cước thành công ngày 07/06/2016</p>\r\n</td>\r\n<td>\r\n<p align="center">2.000 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Gia hạn thành công hàng ngày</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/ngày</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>II</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Áp dụng với các thuê bao đăng ký mới từ ngày 07/06/2016</strong></p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công/gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/ngày</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>III</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trả lời câu hỏi</strong></p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="center">0</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n<li><strong>Mức cước gói Văn hóa:</strong>\r\n<ul>\r\n<li>Với các khách hàng đăng ký mới: Khách hàng sẽ được sử dụng miễn phí gói cước trong 03 ngày đầu tiên.</li>\r\n<li>Với các khách hàng có sử dụng gói cước trong ngày 21/05/2016, tiếp tục gia hạn và tham gia CTKM Rinh lộc phát tài: Khách hàng được sử dụng miễn phí gói cước trong 03 ngày gia hạn đầu tiên.</li>\r\n<li>Sau thời gian miễn phí, mức cước: 6.000 đồng mỗi ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng: Đăng ký, Hủy, Trả lời câu hỏi, Tra cứu mã dự thưởng... đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không thực hiện hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>11. Thông tin về gói Du lịch:</strong></p>\r\n<ul>\r\n<li><strong>Đối tượng:</strong> Các thuê bao đang sử dụng gói Văn hóa.</li>\r\n<li><strong>Nội dung: </strong> Cung cấp các câu hỏi về du lịch, các điểm đến thú vị trên thế giới.</li>\r\n<li><strong>Quyền lợi hàng ngày</strong> :\r\n<ul>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n<li>Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Các câu hỏi của gói Du lịch:</strong>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ nhận được 03 câu hỏi trắc nghiệm liên quan đến chủ đề của gói. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi là hoàn toàn miễn phí</li>\r\n<li>Câu hỏi của chương trình gồm 2 lựa chọn: Đúng hoặc Sai. Đáp án của chương trình đưa ra nhằm mục đích trả lời cho câu hỏi, không phụ thuộc vào câu trả lời của người tham gia. <br> <em>Ví dụ: Tet Doan ngo dien ra vao ngay 03/03 am lich, dung hay sai? 1=Dung 2 = Sai?</em><br> <em>Khi khách hàng trả lời sẽ nhận được phản hồi “Tra loi DUNG” hoặc “Tra loi SAI”, với ý nghĩa: “Tra loi DUNG” nghĩa là đáp án của người chơi đưa ra là ĐÚNG theo đáp án của câu hỏi, “Tra loi SAI” nghĩa là đáp án của người chơi đưa ra là SAI so với đáp án của câu hỏi. </em></li>\r\n</ul>\r\n</li>\r\n<li><strong>Quy định về điểm tích lũy gói Du lịch:</strong>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Đăng ký thành công/gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Phản hồi lời mời tham gia đăng ký gói “Du lịch”</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="center">0</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n<li><strong>Mức cước gói Du lịch</strong>\r\n<ul>\r\n<li>Mức cước 3.000 đồng mỗi ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu mã dự thưởng...đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không thực hiện hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>12. Quy định về 3 ngày miễn phí </strong></p>\r\n<ul>\r\n<li>Với những thuê bao được miễn cước 03 ngày đầu tiên: 03 ngày đầu tiên được tính là 03 ngày đầu sử dụng mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian này, nếu khách hàng hủy và đăng ký lại (lần thứ 2), khách hàng sẽ bị trừ cước ở lần đăng ký tiếp theo.</li>\r\n<li>Trong thời gian miễn phí, khách hàng không bị trừ cước nhưng vẫn được duy trì các quyền lợi khác các gói cước.</li>\r\n<li>Ngày được tính là một ngày theo dương lịch.</li>\r\n</ul>\r\n<p><strong>13. Quy định về phương thức tính cước chung của chương trình</strong></p>\r\n<p><strong><em>13.1. </em><em>Khách hàng chỉ sử dụng gói cước </em><em>Văn hóa</em></strong></p>\r\n<ul>\r\n<li>Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">TKC ≥6.000 đồng</p>\r\n<p align="center"><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">TKC &lt; 6.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n<p><strong><em>13.2. </em><em>Khách hàng sử dụng cả 2 gói cước Văn hóa và Du lịch, </em></strong></p>\r\n<ul>\r\n<li>Gói cước Văn hóa còn thời gian miễn phí:\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥1.500 đồng</p>\r\n<p align="center"><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 1.500 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n<li>Gói cước Văn hóa hết thời gian miễn phí\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥9.000 đồng</p>\r\n<p align="center"><em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥4.500 đồng</p>\r\n<p align="center"><em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">6.000 đồng ≤ TKC &lt; 9.000 đồng</p>\r\n<p align="center"><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 4.500 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 6.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">1.500 đồng ≤ TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 1.500 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n<p><strong><em>13.3. </em><em>Quy định chung</em></strong></p>\r\n<ul>\r\n<li>Trong một ngày, hệ thống chỉ thực hiện tính cước mỗi gói tin theo các mức cước trên. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó.</li>\r\n<li>Tại thời điểm gia hạn, nếu khách hàng sử dụng đồng thời nhiều gói cước, hệ thống sẽ tiến hành trừ cước từng gói theo thứ tự lần lượt là: (1) gói Văn hóa; (2) gói Du lịch.</li>\r\n<li>Cước của gói được trừ vào tài khoản chính với thuê bao trả trước và ghi vào hóa đơn cước với thuê bao trả sau.</li>\r\n<li>Tại thời điểm gia hạn gói cước, nếu tài khoản chính của thuê bao trả trước không đủ ở mức dưới, hệ thống sẽ tiếp tục thực hiện việc thử trừ cước tối đa 01 lần/ ngày và tuân theo quy định tối ưu trừ cước như sau:\r\n<ul>\r\n<li>Bước 1: Hệ thống thực hiện trừ cước khi đăng ký/gia hạn thành công hàng ngày: Trừ cước hàng ngày, retry theo bậc thang.</li>\r\n<li>Bước 2: Hệ thống kiểm tra các thuê bao trừ cước không thành công liên tục trong 03 ngày sẽ xử lý:\r\n<ul>\r\n<li>Các ngày sau hệ thống chỉ thực hiện trừ 01 lần/ngày với mức cước thấp nhất của bậc thang gói dịch vụ.</li>\r\n<li>Nếu trừ được cước của thuê bao hệ thống sẽ thực hiện trừ cước như bình thường như bước đầu trong các ngày tiếp theo.</li>\r\n<li>Nếu trừ cước không thành công trong 30 ngày liên tiếp hệ thống phải thực hiện hủy dịch vụ cho thuê bao.</li>\r\n</ul>\r\n</li>\r\n<li>Ngoài ra hệ thống có thể sử dụng bản tin NEIF để thực hiện retry trừ cước: Thuê bao trừ cước không thành công trong lần trừ cước đầu tiên trong ngày, hệ thống chỉ được phép retry trừ cước trong ngày khi nhận được bản tin NEIF thông báo thuê bao đã nạp tiền.</li>\r\n</ul>\r\n</li>\r\n<li>Khi thuê bao thực hiện gia hạn:\r\n<ul>\r\n<li>Trường hợp thử trừ cước thành công, khách hàng tiếp tục sử dụng dịch vụ bình thường.</li>\r\n<li>Trường hợp thử trừ cước không thành công, khách hàng sẽ không nhận được gói tin, không nhận được điểm tích luỹ nhưng vẫn được tiếp tục duy trì gói cước.</li>\r\n<li>Trường hợp không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ tiến hành huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng phải tiến hành đăng ký lại.</li>\r\n</ul>\r\n</li>\r\n<li>Trường hợp thuê bao bị khoá 01 chiều, hệ thống sẽ tạm dừng cung cấp gói cho đến khi thuê bao hoạt động 02 chiều trở lại, điểm thưởng của khách hàng vẫn được bảo lưu. (Trong thời gian thuê bao bị chặn 01 chiều, hệ thống sẽ không thực hiện trừ cước, không trả điểm cho thuê bao đó. Sau khi thuê bao hoạt động 02 chiều trở lại, hệ thống sẽ mở lại gói và không trừ bù tiền của khách hàng trong thời gian bị khoá 01 chiều đó).</li>\r\n<li>dụng gói phải tự đăng ký lại.</li>\r\n</ul>\r\n<p><strong>14. Cách hủy gói cước:</strong></p>\r\n<ul>\r\n<li>Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.</li>\r\n<li>Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.</li>\r\n<li>Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</li>\r\n</ul>\r\n<p><strong>15. Các quy định khác:</strong></p>\r\n<ul>\r\n<li>Các quy định khác liên quan đến gói cước được áp dụng theo quy định hiện hành</li>\r\n</ul>\r\n<p><strong>16. Cách thức xếp hạng thuê bao trong CTKM:</strong></p>\r\n<ul>\r\n<li>Cuối mỗi chu kỳ xét thưởng (ngày/tháng), chương trình sẽ thực hiện xếp hạng thuê bao theo các tiêu chí có mức độ ưu tiên giảm dần như sau:</li>\r\n<li>Điểm số tích lũy của thuê bao trong chu kỳ đó theo thứ hạng từ cao xuống thấp;</li>\r\n<li>Thời gian đạt được điểm tích lũy đó theo thứ hạng từ nhanh đến chậm. Trong đó, thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày đó. Với chu kỳ tháng, thời gian được tính bằng tổng thời gian của 30 ngày.</li>\r\n<li>Thời điểm đăng ký gói cước (tính từ ngày cung cấp gói cước)</li>\r\n<li>Các thuê bao sẽ được đánh số theo thứ tự tăng dần, bắt đầu từ thuê bao có thành tích tốt nhất. <br> Ví dụ về bảng tổng sắp thứ tự thuê bao\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>Thuê bao</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Điểm tích lũy trong chu kỳ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thời gian đạt điểm</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Xếp hạng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">A</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">400 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">B</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">405 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">C</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">406 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">D</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">470 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">E</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">520 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">F</p>\r\n</td>\r\n<td>\r\n<p align="center">800</p>\r\n</td>\r\n<td>\r\n<p align="center">1200 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">6</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">G</p>\r\n</td>\r\n<td>\r\n<p align="center">700</p>\r\n</td>\r\n<td>\r\n<p align="center">1321 giây</p>\r\n</td>\r\n<td>\r\n<p align="center">7</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n<p><strong>17. Cách thức xác định khách hàng trúng giải</strong></p>\r\n<p><strong><em>17.1. Giải tháng: </em></strong></p>\r\n<ul>\r\n<li>Giải thưởng được trao cho thuê bao xếp hạng 01 của tháng đó.</li>\r\n<li>Thời gian của tháng được tính từ 0h00 đến 23:59:59 của mỗi chu kỳ 30 ngày liên tục, bắt đầu từ ngày triển khai CTKM.</li>\r\n</ul>\r\n<p><strong><em>17.2. Giải ngày: </em></strong></p>\r\n<ul>\r\n<li>Giải thưởng được trao cho 10 thuê bao xếp hạng cao nhất trong ngày.</li>\r\n<li>Ngày được tính là 01 ngày dương lịch, bắt đầu từ 0h00 đến 23:59:59 của ngày đó. Riêng ngày đầu tiên 07/06/2016 được tính từ 15h00 đến 23:59:59 ngày đó.</li>\r\n</ul>', '', '', 'vn', 1);
INSERT INTO `cms_pages` (`id`, `slug`, `title`, `content`, `meta_keywords`, `meta_description`, `lang`, `enabled`) VALUES
(12, 'terms_2', 'Rinh Lộc Phát Tài giai đoạn 2', '<p><strong>1. Tên chương trình:</strong>Rinh lộc phát tài – Giai đoạn 2</p>\r\n<p><strong>2. Thời gian triển khai: </strong></p>\r\n<p>Từ 00h00 ngày 28/12/2016 đến 23h59:59 ngày 26/03/2017 (89 ngày)</p>\r\n<p><strong>3. Hàng hóa, dịch vụ áp dụng khuyến mại:</strong> Gói Văn hóa và gói Du lịch.</p>\r\n<p><strong>4. Đầu số: </strong>678</p>\r\n<p><strong>5. Website dịch vụ: </strong>{cache}</p>\r\n<p><strong>6. Phạm vi khuyến mại: </strong>Toàn quốc</p>\r\n<p><strong>7. Đối tượng và quy định </strong></p>\r\n<ul>\r\n<li>Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:</li>\r\n<ul>\r\n<li>Các thuê bao có tham gia chương trình khuyến mại Rinh lộc phát tài giai đoạn 1</li>\r\n<li>Các thuê bao đăng ký mới gói Văn hóa và gói Du lịch từ ngày 28/12/2016</li>\r\n</ul>\r\n<li>Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ul>\r\n<p><strong>8. Cơ cấu giải thưởng: </strong></p>\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Loại giải</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Nội dung giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Đơn giá</strong><br> <strong>(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thành tiền</strong><br> <strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Giải tuần</p>\r\n</td>\r\n<td>\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p align="right">500.000</p>\r\n</td>\r\n<td>\r\n<p align="center">13</p>\r\n</td>\r\n<td>\r\n<p align="right">6.500.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">Giải tháng</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="right">15.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">03</p>\r\n</td>\r\n<td>\r\n<p align="right">45.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">Giải chung cuộc</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="right">70.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">01</p>\r\n</td>\r\n<td>\r\n<p align="right">70.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4">\r\n<p align="center"><strong>Tổng</strong><strong> cộng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>17</strong></p>\r\n</td>\r\n<td>\r\n<p align="right"><strong>121.500.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align="right"><em>(Bằng chữ: </em><em>Một trăm hai mươi mốt triệu, năm trăm nghìn đồng</em><em>./.)</em></p>\r\n<p><strong>9. Cách tham gia:</strong></p>\r\n<p>9.1 <em>Với các thuê bao đã tham gia CTKM&nbsp; Rinh lộc phát tài giai đoạn 1:</em></p>\r\n<ul>\r\n<li>Hệ thống sẽ gửi tin mời tham gia chương trình khuyến mại giai đoạn 2. Nếu khách hàng soạn tin nhắn đăng ký sẽ được tham gia CTKM giai đoạn 2. Nếu không xác nhận, khách hàng sẽ không được tham gia .</li>\r\n</ul>\r\n<p>9.2 <em>Với các thuê bao đăng ký mới:</em></p>\r\n<p>Để tham gia CTKM, khách hàng thực hiện đăng ký các gói cước như sau:</p>\r\n<ul>\r\n<li>Gói Văn hóa: Soạn DK VH hoặc DK hoặc VH hoặc OK gửi 678</li>\r\n<li>Gói Du lịch: Soạn DK DL hoặc GO hoặc VIP hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.</li>\r\n<li>Sau khi đăng ký thành công, nếu khách hàng không thực hiện hủy, chương trình sẽ thực hiện gia hạn hàng ngày các gói cước.</li>\r\n</ul>\r\n<p><strong>10. Thông tin chi tiết về gói Văn hóa:</strong></p>\r\n<ul>\r\n<li><strong>Nội dung gói: </strong>Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</li>\r\n<li><strong>Quyền lợi hàng ngày</strong></li>\r\n<ul>\r\n<li>Khách hàng được nhận bản tin của gói cước hàng ngày.</li>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ được nhận <strong>05 câu hỏi trắc nghiệm</strong> liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi hoàn toàn miễn phí</li>\r\n<li>Câu hỏi của chương trình gồm 2 lựa chọn: Đúng hoặc Sai.&nbsp; Đáp án của chương trình đưa ra nhằm mục đích trả lời cho câu hỏi, không phụ thuộc vào câu trả lời của người tham gia.<br> <em>Ví dụ: Tet nguyen dan cua nuoc ta con co ten goi khac la Tet duong lich, dung hay sai? 1=Dung 2 = Sai&nbsp;?</em><br> <em>Khi người chơi trả lời 1 hoặc 2 đều nhận được câu trả lời DAP AN: Sai, với ý nghĩa phương án số 2 (SAI) là đáp án chính xác.</em></li>\r\n</ul>\r\n</ul>\r\n<ul>\r\n<li><strong>Quy định về điểm tích lũy gói Văn hóa:</strong>\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>I</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p><strong>Áp dụng với các thuê bao đã sử dụng gói cước tính đến ngày 28/12/2016</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>&nbsp;</strong></p>