 được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>11. Thông tin về gói Du lịch</strong><strong>:</strong></p>\r\n<ul>\r\n<li><strong>Đối tượng:</strong> Các thuê bao đang sử dụng gói Văn hóa.</li>\r\n<li><strong>Nội dung: </strong>Cung cấp các câu hỏi về du lịch, các điểm đến thú vị trên thế giới.</li>\r\n<li><strong>Quyền lợi hàng ngày</strong>:</li>\r\n<ul>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n<li>Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói Du lịch:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ nhận được 03 câu hỏi trắc nghiệm liên quan đến chủ đề của gói. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi là hoàn toàn miễn phí</li>\r\n<li>Câu hỏi của chương trình gồm 2 lựa chọn: Đúng hoặc Sai. Đáp án của chương trình đưa ra nhằm mục đích trả lời cho câu hỏi, không phụ thuộc vào câu trả lời của người tham gia.<br> <em>Ví dụ: Tet Doan ngo dien ra vao ngay 03/03 am lich, dung hay sai? 1=Dung 2 = Sai&nbsp;?</em><br> <em>Khi người chơi trả lời 1 hoặc 2 đều nhận được câu trả lời DAP AN: Sai, với ý nghĩa phương án số 2 (SAI) là đáp án chính xác.</em></li>\r\n</ul>\r\n</ul>\r\n<ul>\r\n<li><strong>Quy</strong><strong> định về điểm tích lũy gói Du lịch:</strong>\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công/gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Phản hồi lời mời đăng ký gói Du lịch</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Trả lời đúng câu hỏi</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Trả lời sai câu hỏi</p>\r\n</td>\r\n<td>\r\n<p align="center">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n<li><strong>Mức</strong><strong> cước gói Du lịch</strong></li>\r\n<ul>\r\n<li>Mức cước 3.000 đồng mỗi ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu mã dự thưởng...đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không thực hiện hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>12. Quy định về 3 ngày miễn phí </strong></p>\r\n<ul>\r\n<li>Với những thuê bao được miễn cước 03 ngày đầu tiên: 03 ngày đầu tiên được tính là 03 ngày đầu sử dụng mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian này, nếu khách hàng hủy và đăng ký lại (lần thứ 2), khách hàng sẽ bị trừ cước ở lần đăng ký tiếp theo.</li>\r\n<li>Trong thời gian miễn phí, khách hàng không bị trừ cước nhưng vẫn được duy trì các quyền lợi khác các gói cước.&nbsp;</li>\r\n<li>Ngày được tính là một ngày theo dương lịch.</li>\r\n</ul>\r\n<p><strong>13. Quy</strong><strong> định về phương thức tính cước chung của chương trình</strong></p>\r\n<p><strong><em>13.1 Khách hàng chỉ sử dụng gói cước </em></strong><strong><em>Văn hóa</em></strong></p>\r\n<ul>\r\n<ul>\r\n<li>Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:&nbsp;\r\n<div align="center">\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥6.000 đồng <br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 6.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n</ul>\r\n<p><strong><em>13.2 Khách hàng sử dụng cả 2 gói cước Văn hóa&nbsp; và Du lịch</em></strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li>Gói cước Văn hóa còn thời gian miễn phí:\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥1.500 đồng <br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n<li>Gói cước Văn hóa hết thời gian miễn phí\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥9.000 đồng<br> <em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥4.500 đồng<br> <em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">6.000 đồng ≤ TKC &lt; 9.000 đồng<br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 4.500 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 6.000 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">1.500 đồng ≤ TKC &lt; 3.000 đồng<br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong><em>13.3 Quy định chung</em></strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li>Trong một ngày, hệ thống chỉ thực hiện tính cước mỗi gói tin theo các mức cước trên. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó.</li>\r\n<li>Tại thời điểm gia hạn, nếu khách hàng sử dụng đồng thời nhiều gói cước, hệ thống sẽ tiến hành trừ cước từng gói theo thứ tự lần lượt là: (1) gói Văn hóa; (2) gói Du lịch.</li>\r\n<li>Cước của gói được trừ vào tài khoản chính với thuê bao trả trước và ghi vào hóa đơn cước với thuê bao trả sau.</li>\r\n<li>Tại thời điểm gia hạn gói cước, nếu tài khoản chính của thuê bao trả trước không đủ ở mức dưới, hệ thống sẽ tiếp tục thực hiện việc thử trừ cước tối đa 01 lần/ ngày và tuân theo quy định tối ưu trừ cước như sau:\r\n<ul>\r\n<li>Bước 1: Hệ thống thực hiện trừ cước khi đăng ký/gia hạn thành công hàng ngày: Trừ cước hàng ngày, theo bậc thang.</li>\r\n<li>Bước 2: Hệ thống kiểm tra các thuê bao trừ cước không thành công liên tục trong 03 ngày sẽ xử lý:\r\n<ul>\r\n<li>Các ngày sau hệ thống chỉ thực hiện trừ 01 lần/ngày với mức cước thấp nhất của bậc thang gói dịch vụ.</li>\r\n<li>Nếu trừ được cước của thuê bao hệ thống sẽ thực hiện trừ cước như bình thường như bước đầu trong các ngày tiếp theo.</li>\r\n<li>Nếu trừ cước không thành công trong 30 ngày liên tiếp hệ thống phải thực hiện hủy dịch vụ cho thuê bao.</li>\r\n</ul>\r\n</li>\r\n<li>Ngoài ra hệ thống có thể sử dụng bản tin NEIF để thực hiện retry trừ cước: Thuê bao trừ cước không thành công trong lần trừ cước đầu tiên trong ngày, hệ thống chỉ được phép retry trừ cước trong ngày khi nhận được bản tin NEIF thông báo thuê bao đã nạp tiền.</li>\r\n</ul>\r\n</li>\r\n<li>Khi thuê bao thực hiện gia hạn:\r\n<ul>\r\n<li>Trường hợp thử trừ cước thành công, khách hàng tiếp tục sử dụng dịch vụ bình thường.</li>\r\n<li>Trường hợp thử trừ cước không thành công, khách hàng sẽ không nhận được gói tin, không nhận được điểm tích luỹ nhưng vẫn được tiếp tục duy trì gói cước.</li>\r\n<li>Trường hợp không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ tiến hành huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng phải tiến hành đăng ký lại.</li>\r\n<li>Trường hợp thuê bao bị khoá 01 chiều, hệ thống sẽ tạm dừng cung cấp gói cho đến khi thuê bao hoạt động 02 chiều trở lại, điểm thưởng của khách hàng vẫn được bảo lưu. (Trong thời gian thuê bao bị chặn 01 chiều, hệ thống sẽ không thực hiện trừ cước, không trả điểm và mã dự thưởng cho thuê bao đó. Sau khi thuê bao hoạt động 02 chiều trở lại, hệ thống sẽ mở lại gói và không trừ bù tiền của khách hàng trong thời gian bị khoá 01 chiều đó).</li>\r\n</ul>\r\n</li>\r\n<li>Trường hợp thuê bao bị khóa 2 chiều, hệ thống sẽ tự động hủy gói của khách hàng, đồng thời toàn bộ điểm và mã dự thưởng của thuê bao tích lũy trước đó sẽ không được bảo lưu. Khi đó, khách hàng muốn sử dụng gói phải tự đăng ký lại.</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong>14. Cách hủy gói cước:</strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li>Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.</li>\r\n<li>Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.</li>\r\n<li>Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong>15. Cách thức xác định khách hàng trúng giải</strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li><strong>Giải tuần:</strong></li>\r\n<ul>\r\n<li>Giải thưởng sẽ được trao cho thuê bao có thứ tự xếp hạng nhất định trong từng tuần, xét trên tiêu chí điểm tích lũy từ cao xuống thấp và thời gian đạt điểm tích lũy từ nhanh đến chậm.</li>\r\n<li>Thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày cuối cùng của tuần xét giải đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày hôm đó. Đơn vị sẽ được tính chính xác đến đơn vị milisecond giây.</li>\r\n<li>Mỗi tuần dùng để xét thưởng được tính là 07 ngày dương lịch liên tục.&nbsp;Tuần cuối cùng là 05 ngày dương lịch liên tục.</li>\r\n<li>Tiêu chí xét thưởng cụ thể như sau:\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tiêu chí xét thưởng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 1</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 01 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 2</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 02 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 3</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 03 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 4</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 04 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 5</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 05 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">6</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 6</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 06 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">7</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 7</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 07 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">8</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 8</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 08 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">9</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 9</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 09 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">10</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 10</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 10 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">11</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 11</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 11 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">12</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 12</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 12 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">13</p>\r\n</td>\r\n<td>\r\n<p align="center">Tuần 13</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có điểm số tích lũy cao thứ 13 trong tuần đó</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</ul>\r\n<ul>\r\n<li><strong>Giải tháng</strong>:</li>\r\n<ul>\r\n<li>Giải thưởng sẽ được trao cho thuê bao có thứ tự xếp hạng nhất định trong từng tháng, xét trên tiêu chí điểm tích lũy từ cao xuống thấp và thời gian đạt điểm tích lũy từ nhanh đến chậm.</li>\r\n<li>Thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày cuối cùng của tháng xét giải đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày hôm đó. Đơn vị sẽ được tính chính xác đến đơn vị milisecond giây.</li>\r\n<li>Mỗi tháng dùng để xét thưởng được tính là 30 ngày dương lịch liên tục. Tháng thứ 3 là 29 ngày dương lịch liên tục.</li>\r\n<li>Tiêu chí xét thưởng cụ thể như sau:\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tiêu chí xét thưởng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Tháng thứ 1</p>\r\n</td>\r\n<td>\r\n<p>Thuê bao có điểm số tích lũy cao thứ 06 trong tháng đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">Tháng thứ 2</p>\r\n</td>\r\n<td>\r\n<p>Thuê bao có điểm số tích lũy cao thứ 07 trong tháng đó</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">Tháng thứ 3</p>\r\n</td>\r\n<td>\r\n<p>Thuê bao có điểm số tích lũy cao thứ 08 trong tháng đó</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</ul>\r\n<ul>\r\n<li><strong>Giải chung cuộc</strong>:</li>\r\n<ul>\r\n<li>Giải thưởng sẽ được trao cho thuê bao có thứ tự xếp hạng nhất định trong thời gian diễn ra CTKM, xét trên tiêu chí điểm tích lũy từ cao xuống thấp và thời gian đạt điểm tích lũy từ nhanh đến chậm.</li>\r\n<li>Thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày cuối cùng của Chương trình khuyến mại đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày hôm đó. Đơn vị sẽ được tính chính xác đến đơn vị milisecond giây.</li>\r\n<li>Giải được tính từ ngày bắt đầu CTKM cho đến khi kết thúc CTKM (89 ngày).</li>\r\n<li>Tiêu chí xét thưởng cụ thể như sau:\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Tiêu chí xét thưởng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Giải chung cuộc</p>\r\n</td>\r\n<td>\r\n<p align="center">Thuê bao có số điểm tích lũy cao thứ 10 trong CTKM</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong>16. Thời gian, Địa điểm và thủ tục trao thưởng:</strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li>Sau khi có kết quả trúng thưởng, danh sách khách hàng trúng thưởng sẽ được đăng tải trên website chính thức của MobiFone và website của chương trình. Khách hàng có thể chủ động truy cập vào các địa chỉ trên để biết thông tin trúng thưởng.</li>\r\n<li>Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ công bố công khai điểm số trúng thưởng. Các số điện thoại trúng thưởng sẽ được giấu 02 chữ số cuối, nhằm đảm bảo tính bảo mật cá nhân của người trúng giải.</li>\r\n<li>Đối với giải thưởng bằng thẻ cào MobiFone: Giải thưởng sẽ được chuyển tới khách hàng thông qua hình thức nạp tiền trực tuyến</li>\r\n<li>Đối với các khách hàng trúng giải tháng, Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ thông báo cho khách hàng trúng thưởng theo các phương thức sau:\r\n<ul>\r\n<li>Gọi điện thoại thông báo cho khách hàng từ một trong các Số điện thoại sau:</li>\r\n<li>08.3962 1501/ 08.3962 1502</li>\r\n<li>0511.3848 999</li>\r\n<li>04.3782 3151<br> Tần suất và thời gian gọi điện thoại tối đa cho một thuê bao như sau: 03 lần một ngày trong 5 ngày làm việc liên tục, trong khoảng thời gian từ 8h00 sáng tới 20h00 tối.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>&nbsp;Nhắn tin từ đầu số 090 với nội dung:<br> <em>”MobiFone chuc mung quy khach da trung thuong giai X chuong trinh khuyen mai "Rinh loc phat tai”. Quy khach truy cap website </em><a href="{cache}"><em>{cache}</em></a><em> de biet thong tin chi tiet”</em></li>\r\n</ul>\r\n<ul>\r\n<li>Đối với giải thưởng bằng tiền mặt: Giải thưởng sẽ được chuyển khoản cho khách hàng trúng giải qua tài khoản ngân hàng. Khách hàng cần cung cấp tài khoản mở tại các ngân hàng được phép hoạt động trên lãnh thổ Việt Nam để nhận thưởng. Khách hàng trúng giải đến làm thủ tục nhận thưởng tại cửa hàng MobiFone.</li>\r\n<li>Khách hàng trúng thưởng cần chuẩn bị các giấy tờ sau để làm thủ tục nhận thưởng:\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên cá nhân:\r\n<div align="center">\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên tổ chức:\r\n<div align="center">\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center"><em>&nbsp;</em></p>\r\n</td>\r\n<td>\r\n<p><em>Nếu khách hàng trúng giải bằng tiền, cần bổ sung các giấy tờ sau</em></p>\r\n</td>\r\n<td>\r\n<p><em>&nbsp;</em></p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:\r\n<table border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">&nbsp;</p>\r\n<p align="center">2</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>Vào thời điểm nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động 2 chiều và có thông tin cá nhân trùng với thông tin thuê bao đã đăng ký với Tổng Công ty Viễn thông MobiFone .</li>\r\n<li>Sau thời điểm công bố trúng thưởng, nếu khách hàng chuyển quyền sở hữu số thuê bao trúng thưởng cho nhau, thì chủ sở hữu thuê bao cũ (trước thời điểm chuyển quyền) không được quyền nhận thưởng; chủ sở hữu mới (sau thời điểm chuyển quyền) khi đó được quyền nhận thưởng nếu đáp ứng đầy đủ các điều kiện sau:\r\n<ul>\r\n<li>Có sở hữu thẻ SIM chứa số thuê bao trúng giải;</li>\r\n<li>Có văn bản thỏa thuận chuyển nhượng quyền sở hữu thuê bao, có sự chứng kiến của đại diện MobiFone;</li>\r\n<li>Có văn bản đồng ý của chủ sở hữu cũ về việc được quyền sở hữu giải thưởng phát sinh từ số thuê bao trúng thưởng CTKM này;</li>\r\n<li>Còn trong thời hạn trao thưởng của CTKM này;</li>\r\n<li>Các điều kiện khác đươc quy định tại thể lệ của CTKM này.</li>\r\n<li>Nếu không đáp ứng được các tiêu chuẩn trên, chủ sở hữu mới không được quyền nhận thưởng. Khi đó giải thưởng được coi là giải thưởng không có người nhận; ban tổ chức CTKM có trách nhiệm xử lý giải thưởng theo đúng quy định hiện hành.</li>\r\n</ul>\r\n</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng Công ty Viễn thông MobiFone.</li>\r\n<li>Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).</li>\r\n<li>Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.</li>\r\n<li>Thời hạn cuối cùng Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong>17. Trách nhiệm thông báo:</strong></p>\r\n<ul>\r\n<ul>\r\n<ul>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại, danh sách khách hàng trúng thưởng trên website chính thức của MobiFone và website của chương trình</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n<p><strong>18. Quy định khác </strong></p>\r\n<ul>\r\n<ul>\r\n<li>Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.</li>\r\n<li>Khách hàng trúng thưởng phải chịu mọi chi phí trong việc vận chuyển giải thưởng từ địa điểm nhận giải thưởng đến địa điểm khách hàng mong muốn.</li>\r\n<li>Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.</li>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone và Tổng Công ty Viễn thông MobiFone được toàn quyền sử dụng thông tin cá nhân của khách hàng trúng giải (họ tên, tuổi, số điện thoại, địa chỉ, hình ảnh, giọng nói...) cho mục đích quảng cáo thương mại mà không phải trả chi phí.</li>\r\n<li>Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</li>\r\n</ul>\r\n</ul>', '', '', 'vn', 1);
INSERT INTO `cms_pages` (`id`, `slug`, `title`, `content`, `meta_keywords`, `meta_description`, `lang`, `enabled`) VALUES
(13, 'terms_3', 'Rinh Lộc Phát Tài giai đoạn 3', '<ol>\r\n<li><strong>Tên</strong><strong> chương trình: </strong>Rinh lộc phát tài – Giai đoạn 3</li>\r\n<li><strong>Thời</strong><strong> gian triển khai:<br></strong>Từ 15h00 ngày 10/04/2017 đến 23h59:59 ngày 08/07/2017 (90 ngày)<br><strong>(Kết thúc CTKM các gói cước tiếp tục được cung cấp đến khách hàng)</strong></li>\r\n</ol><ol start="3">\r\n<li><strong>Hàng hóa, dịch vụ áp dụng khuyến mại:</strong> Gói Văn hóa và gói Du lịch.</li>\r\n<li><strong>Đầu số: </strong>678</li>\r\n<li><strong>Website dịch vụ: </strong>{cache}</li>\r\n<li><strong>Phạm vi khuyến mại: </strong>Toàn quốc</li>\r\n<li><strong>Đối tượng và quy định<br></strong>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:<br>+&nbsp;&nbsp;&nbsp;&nbsp; Các thuê bao có tham gia chương trình khuyến mại Rinh lộc phát tài giai đoạn 2<br>+&nbsp;&nbsp;&nbsp;&nbsp; Các thuê bao đăng ký mới gói Văn hóa và gói Du lịch từ ngày 10/04/2017<br>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ol><ol start="8">\r\n<li><strong>Cơ cấu giải thưởng: </strong></li>\r\n</ol>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Loại giải</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Đơn giá</strong></p>\r\n<p><strong>(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Thành tiền</strong></p>\r\n<p><strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>Giải gắn kết</p>\r\n</td>\r\n<td>\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p>20.000&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>5.000&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>100.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Giải chung cuộc</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p>70.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>1&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>70.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Giải tháng</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p>10,000,000</p>\r\n</td>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>30,000,000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Giải tuần</p>\r\n</td>\r\n<td>\r\n<p>Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p>5.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>13&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>65.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>5</p>\r\n</td>\r\n<td>\r\n<p>Giải Ngày</p>\r\n</td>\r\n<td>\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p>50.000&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>2.700&nbsp;&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>135.000.000&nbsp;&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4">\r\n<p><strong>&nbsp;</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>7.714&nbsp;&nbsp; </strong></p>\r\n</td>\r\n<td>\r\n<p><strong>400.000.000&nbsp;&nbsp; </strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: right;"><em>(Bằng chữ: </em><em>Bốn trăm triệu đồng</em><em>./.)</em></p>\r\n<ol start="9">\r\n<li><strong>Cách tham gia:<br></strong><em>9.1.</em><em>Với các thuê bao đã tham gia CTKM&nbsp; Rinh lộc phát tài giai đoạn 2<br></em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Hệ thống sẽ gửi tin mời tham gia chương trình khuyến mại giai đoạn 3. Nếu khách hàng soạn tin nhắn đăng ký sẽ được tham gia CTKM giai đoạn 3. Nếu không xác nhận, khách hàng sẽ không được tham gia<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - 5.000 thuê bao xác nhận gia hạn đầu tiên sẽ được tặng 20.000 VND vào tài khoản chính.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Nội dung nhắn tin mời xác nhận: <em>Quà tặng cho bạn! Soạn Y gửi 678 (MIỄN PHÍ) để được NHẬN NGAY 20.000 đồng vào TKC, áp dụng cho 5.000 thuê bao đầu tiên soạn tin xác nhận tham gia CTKM Rinh Lộc Phát Tài. Tham gia CTKM từ ngày 10/04/2017 còn có cơ hội nhận hàng trăm giải thưởng giá trị khác. Cước phí: 6.000đ/ngày cho gói “Văn Hóa”, 3.000đ/ngày cho gói “Du Lịch”. Để hủy, soạn HUY gửi 678. Chi tiết, liên hệ 9090.</em></li>\r\n</ol>\r\n<p style="padding-left: 30px;"><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -</em><em>&nbsp;</em>Tất cả các thuê bao tiếp tục gia hạn sang giai đoạn tiếp theo và không hủy dịch vụ trước ngày 13/04/2017 sẽ được cộng thêm 2000 điểm thưởng vào ngày 14/04 sau đó.</p>\r\n<p style="padding-left: 30px;"><em>&nbsp; 9.2.</em><em>Với các thuê bao đăng ký mới:<br></em>&nbsp;&nbsp;Để tham gia chương trình khuyến mại, trước tiên, khách hàng cần đăng ký gói“Văn hóa”, Có 2 cách đăng ký như sau:<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;Kênh SMS soạn tin: OK gửi 678</p>\r\n<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- Kênh ussd bấm: *678# (nhấn núi gọi). Sau đó nhấn 1 và gửi để đăng kí hoặc bấm *678*1# (nhấn nút gọi)<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Gói Du lịch: Soạn DK DL hoặc GO hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sau khi đăng ký thành công, nếu khách hàng không hủy, chương trình sẽ gia hạn hàng ngày &nbsp; các gói cước.</p>\r\n<ol start="10">\r\n<li><strong>Thông tin chi tiết về gói Văn hóa:</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Nội dung gói: </strong>Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Quyền lợi hàng ngày</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Khách hàng được nhận bản tin của gói cước hàng ngày.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Các câu hỏi của gói:</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Hàng ngày, khách hàng sẽ được nhận <strong>05 câu hỏi trắc nghiệm</strong> liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Thời gian trả lời câu hỏi không bị giới hạn<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Cước trả lời câu hỏi hoàn toàn miễn phí<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Quy định về điểm tích lũy gói Văn hóa:</strong></li>\r\n</ol>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công/ gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p>100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p>100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p>0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n<td>\r\n<p>Phản hồi lời mời tham gia gói “Du lịch”</p>\r\n</td>\r\n<td>\r\n<p>100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Giá cước gói Văn hóa:</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Với các khách hàng đăng ký mới: Được sử dụng miễn phí gói cước trong <strong>03 ngày đầu tiên.</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+ Với các khách hàng đồng ý tham gia chương trình giai đoạn 3: Khách hàng được sử dụng miễn phí gói cước trong <strong>03 ngày gia hạn đầu tiên.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>+ Sau thời gian miễn phí, mức cước: 6.000 đồng mỗi ngày (đã bao gồm VAT).<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Mọi thao tác khác của khách hàng: Đăng ký, Hủy, Trả lời câu hỏi, Tra cứu mã dự thưởng... đều hoàn toàn miễn phí.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</p>\r\n<ol start="11">\r\n<li><strong>Thông tin về gói Du lịch</strong><strong>:</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Đối tượng:</strong> Các thuê bao đang sử dụng gói Văn hóa.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Nội dung: </strong>Cung cấp các câu hỏi về du lịch, các điểm đến thú vị trên thế giới.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Cách tham gia: </strong>Khách hàng chủ động soạn tin DK DL/GO/DX gửi 678<br> <br> Hoặc xác nhận việc sử dụng gói “Du lịch” bằng cách soạn 1 hoặc 2 gửi 678 sau khi nhận được SMS mời tham gia sử dụng gói “Du lịch” của chương trình (sau khi trả lời xong câu hỏi thứ 2 hoặc câu hỏi thứ 5 của gói “Văn hóa”)<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Quyền lợi hàng ngày</strong>:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Các câu hỏi của gói Du lịch:</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Hàng ngày, khách hàng sẽ nhận được <strong>03 câu hỏi trắc nghiệm</strong> liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Thời gian trả lời câu hỏi không bị giới hạn<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Cước trả lời câu hỏi là hoàn toàn miễn phí<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Quy</strong><strong> định về điểm tích lũy gói Du lịch:</strong></li>\r\n</ol>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công/gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p>1.000 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p>100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p>0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Giá</strong><strong> cước gói Du lịch</strong><strong>:</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Mức cước <strong>3.000 đồng</strong>/ngày (đã bao gồm VAT).<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu mã dự thưởng...đều hoàn toàn miễn phí.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+&nbsp;&nbsp;&nbsp;&nbsp; Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</p>\r\n<ol start="12">\r\n<li><strong>Quy</strong><strong> định về 3 ngày miễn phí </strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mỗi thuê bao có 03 ngày trải nghiệm miễn phí đầu tiên cho gói ”<strong>Văn hóa</strong>”<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gói<strong>”Du lịch” không có 03 ngày trải nghiệm miễn phí.</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 03 ngày đầu tiên được tính là <strong>03 ngày đầu sử dụng</strong> mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian miễn phí 03 ngày đầu tiên kể từ lần đầu tiên, nếu khách hàng hủy và đăng ký lại (lần thứ 2), khách hàng sẽ <strong>không bị trừ cước</strong> ở lần đăng ký tiếp theo.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong trường hợp khách hàng hủy trong thời gian 03 ngày miễn phí và đăng ký lại vào ngày thứ 4, khách hàng cũng sẽ không được hưởng nốt thời gian miễn phí còn lại của 03 ngày đầu tiên.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong thời gian miễn phí, khách hàng không bị tính cước và vẫn được duy trì các quyền lợi của gói cước.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ngày được tính là một ngày theo dương lịch.</li>\r\n</ol><ol start="13">\r\n<li><strong>Quy</strong><strong> định về phương thức tính cước chung của chương trình</strong><br> <em>13.1.&nbsp;&nbsp;&nbsp; </em><strong><em>Khách hàng chỉ sử dụng gói cước </em></strong><strong><em>Văn hóa</em></strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:&nbsp;</li>\r\n</ol>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>TKC ≥6.000 đồng</p>\r\n<p><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>TKC ≥3.000 đồng</p>\r\n<p><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>TKC &lt; 6.000 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>TKC &lt; 3.000 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>13.2.&nbsp;&nbsp;&nbsp; </em><strong><em>Khách hàng sử dụng cả 2 gói cước Văn hóa&nbsp; và Du lịch</em></strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gói cước Văn hóa còn thời gian miễn phí:</p>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>TKC ≥3.000 đồng</p>\r\n<p><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>TKC ≥1.500 đồng</p>\r\n<p><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>TKC &lt; 3.000 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>TKC &lt; 1.500 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Gói cước Văn hóa hết thời gian miễn phí</p>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>TKC ≥9.000 đồng</p>\r\n<p><em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>TKC ≥4.500 đồng</p>\r\n<p><em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>6.000 đồng ≤ TKC &lt; 9.000 đồng</p>\r\n<p><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>3.000 đồng ≤ TKC &lt; 4.500 đồng</p>\r\n<p><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>3.000 đồng ≤ TKC &lt; 6.000 đồng</p>\r\n<p><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>1.500 đồng ≤ TKC &lt; 3.000 đồng</p>\r\n<p><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n<td>\r\n<p>Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n<td>\r\n<p>0 ≤ TKC &lt; 3.000 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>0 ≤ TKC &lt; 1.500 đồng</p>\r\n<p><em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n<td>\r\n<p>Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13.3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em><strong><em>Quy định chung</em></strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong một ngày, hệ thống chỉ tính cước mỗi gói tin theo các mức cước trên. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tại thời điểm gia hạn, nếu khách hàng sử dụng đồng thời nhiều gói cước, hệ thống sẽ tiến hành trừ cước từng gói theo thứ tự lần lượt là: (1) gói Văn hóa; (2) gói Du lịch.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cước của gói được trừ vào tài khoản chính với thuê bao trả trước và ghi vào hóa đơn cước với thuê bao trả sau.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tại thời điểm gia hạn gói cước, nếu tài khoản chính của thuê bao trả trước không đủ ở mức dưới, hệ thống sẽ tiếp tục trừ cước tối đa 01 lần/ ngày và tuân theo quy định tối ưu trừ cước như sau:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Bước 1: Hệ thống trừ cước khi đăng ký/gia hạn thành công hàng ngày: Trừ cước hàng ngày, theo bậc thang.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Bước 2: Hệ thống kiểm tra các thuê bao trừ cước không thành công liên tục trong 03 ngày sẽ xử lý:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp; Các ngày sau hệ thống chỉ trừ cước 01 lần/ngày với mức cước thấp nhất của bậc thang gói dịch vụ.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp; Nếu trừ được cước của thuê bao hệ thống sẽ trừ cước như bình thường như bước đầu trong các ngày tiếp theo.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *&nbsp; Nếu trừ cước không thành công trong 30 ngày liên tiếp hệ thống sẽ hủy dịch vụ cho thuê bao.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Ngoài ra hệ thống có thể sử dụng bản tin NEIF để trừ cước: Thuê bao trừ cước không thành công trong lần trừ cước đầu tiên trong ngày, hệ thống chỉ được phép retry trừ cước trong ngày khi nhận được bản tin NEIF thông báo thuê bao đã nạp tiền.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Khi thuê bao gia hạn:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp trừ cước thành công, khách hàng tiếp tục sử dụng dịch vụ bình thường.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp thử trừ cước không thành công, khách hàng sẽ không nhận được gói tin, không nhận được điểm tích luỹ nhưng vẫn được tiếp tục duy trì gói cước.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ tiến hành huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng phải tiến hành đăng ký lại.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp thuê bao bị khoá 01 chiều, hệ thống sẽ tạm dừng cung cấp gói cho đến khi thuê bao hoạt động 02 chiều trở lại, điểm thưởng của khách hàng vẫn được bảo lưu. (Trong thời gian thuê bao bị chặn 01 chiều, hệ thống sẽ không trừ cước, không trả điểm và mã dự thưởng cho thuê bao đó. Sau khi thuê bao hoạt động 02 chiều trở lại, hệ thống sẽ mở lại gói và không trừ bù tiền của khách hàng trong thời gian bị khoá 01 chiều đó).<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp thuê bao bị khóa 2 chiều, hệ thống sẽ tự động hủy gói của khách hàng, đồng thời toàn bộ điểm và mã dự thưởng của thuê bao tích lũy trước đó sẽ không được bảo lưu. Khi đó, khách hàng muốn sử dụng gói phải tự đăng ký lại.</p>\r\n<ol start="14">\r\n<li><strong>Cách hủy gói cước:</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</li>\r\n</ol><ol start="15">\r\n<li><strong>Cách thức xếp hạng thuê bao trong CTKM:</strong></li>\r\n</ol>\r\n<p>Cuối mỗi chu kỳ xét thưởng (ngày/tháng), chương trình sẽ xếp hạng thuê bao theo các tiêu chí có mức độ ưu tiên giảm dần như sau:</p>\r\n<p style="padding-left: 90px;">- &nbsp;Điểm số tích lũy của thuê bao trong chu kỳ đó theo thứ hạng từ cao xuống thấp;<br>- &nbsp;Thời gian đạt được điểm tích lũy đó theo thứ hạng từ nhanh đến chậm. Trong đó, thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày đó, hoặc dựa theo thời điểm khách hàng đạt được số điểm đã tích lũy dựa trên điểm thưởng khi đăng kí, gia hạn.... hay các tương tác khác. Với chu kỳ tuần, thời gian được tính bằng tổng thời gian của 07 ngày.<br>- &nbsp;Thời điểm đăng ký gói cước Văn hóa (tính từ ngày cung cấp gói cước)<br>- &nbsp;Các thuê bao đã được đánh số theo thứ tự tăng dần, bắt đầu từ thuê bao có thành tích tốt nhất.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Ví dụ về bảng tổng sắp thứ tự thuê bao:</p>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Thuê bao</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Điểm tích lũy trong chu kỳ</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Thời gian đăng ký</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Xếp hạng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>A</p>\r\n</td>\r\n<td>\r\n<p>1.000</p>\r\n</td>\r\n<td>\r\n<p>12/11/2015 15:11:10</p>\r\n</td>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>B</p>\r\n</td>\r\n<td>\r\n<p>1.000</p>\r\n</td>\r\n<td>\r\n<p>23/11/2015 20:11:10</p>\r\n</td>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>C</p>\r\n</td>\r\n<td>\r\n<p>1.000</p>\r\n</td>\r\n<td>\r\n<p>28/01/2016 23:11:18</p>\r\n</td>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>D</p>\r\n</td>\r\n<td>\r\n<p>900</p>\r\n</td>\r\n<td>\r\n<p>11/07/2016 23:56:18</p>\r\n</td>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>E</p>\r\n</td>\r\n<td>\r\n<p>900</p>\r\n</td>\r\n<td>\r\n<p>18/07/2016 21:58:18</p>\r\n</td>\r\n<td>\r\n<p>5</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>F</p>\r\n</td>\r\n<td>\r\n<p>800</p>\r\n</td>\r\n<td>\r\n<p>19/09/2016 21:16:18</p>\r\n</td>\r\n<td>\r\n<p>6</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ol start="16">\r\n<li><strong>Cách thức xác định khách hàng trúng giải</strong><br> -&nbsp;<strong>Giải chung cuộc</strong>:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Giải chung cuộc được trao cho thuê bao xếp hạng thứ <strong>1</strong> trong toàn chương trình.<br> -&nbsp;<strong>Giải Tháng:</strong><br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>+</strong> Giải tháng được trao cho thuê bao xếp hạng thứ 50 trong tháng đó<br> -&nbsp;<strong>Giải Tuần</strong>:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Giải Tuần được trao cho thuê bao xếp thứ 100 trong tuần đó<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Tuần được tính là 07 ngày dương lịch liên tiếp, bắt đầu từ ngày diễn ra CTKM. Tuần cuối cùng có 06 ngày dương lịch liên tiếp.<br> <strong>Chú ý: 01 thuê bao và 01 cá nhân đứng tên chỉ được trúng giải 01 tuần duy nhất trong suốt CTKM. Nếu thuê bao hoặc cá nhân đã trúng giải của tuần trước, đủ điều kiện trúng giải tuần khác, thì giải tuần khác sẽ được trao cho thuê bao xếp hạng liền sau.<br> </strong>-&nbsp;<strong>Giải Ngày – Áp dụng cho thuê bao đăng ký mới</strong>:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thuê bao trúng thưởng thỏa mãn đủ 2 điều kiện sau:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; 30 thuê bao đầu tiên đăng ký mới gói ”Văn hóa” trong ngày đó (chỉ áp dụng với thuê bao đăng ký lần đầu trong CTKM)<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Có trừ cước thành công gói ”Văn hóa” 2 ngày liên tiếp sau 3 ngày miễn phí<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp; Tần suất công bố danh sách trúng thưởng: 07 ngày/lần</li>\r\n</ol>\r\n<p style="padding-left: 30px;">&nbsp; - Trường hợp có nhiều hơn 02 thuê bao có tổng điểm chu kỳ xét giải bằng nhau thì căn cứ trao &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;thưởng theo thứ tự ưu tiên như sau</p>\r\n<p style="padding-left: 30px;">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + Thuê bao đạt số điểm cao nhất đầu tiên (điểm chiến thắng) sẽ được xếp trước và đạt giải nhất chung cuộc<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + Thuê bao trả đạt được điểm tích lũy trong thời gian sớm nhất sẽ được xếp trước, các thuê bao sau đó với số điểm tương tự sẽ được sắp xếp sau theo thứ tự thời gian đạt điểm tích lũy.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + Thuê bao đăng ký tham gia dịch vụ sớm nhất. Nếu thuê bao hủy dịch vụ đi đăng ký lại nhiều lần thì sẽ lấy lần đăng ký gần nhất của thuê bao để xét. Thời gian được quy định là thời gian trên hệ thống kỹ thuật của CTKM Ring lộc phát tài, không căn cứ theo thời gian trên máy thiết bị của khách hàng.<br>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + Với giải tuần và giải tháng sẽ lấy khách hàng đứng đúng thứ tự thứ 50 của tháng và 100 của tuần theo quy định xếp hạng như trên.</p>\r\n<ol start="17">\r\n<li><strong>Thời gian, Địa điểm và thủ tục trao thưởng:</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau khi có kết quả trúng thưởng, danh sách khách hàng trúng thưởng sẽ được đăng tải trên website chính thức của MobiFone và website của chương trình. Khách hàng có thể chủ động truy cập vào các địa chỉ trên để biết thông tin trúng thưởng.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ công bố công khai điểm số trúng thưởng. Các số điện thoại trúng thưởng sẽ được giấu 02 chữ số cuối, nhằm đảm bảo tính bảo mật cá nhân của người trúng giải.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đối với giải thưởng bằng thẻ cào MobiFone: Giải thưởng sẽ được chuyển tới khách hàng thông qua hình thức nạp tiền trực tuyến<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đối với các khách hàng trúng giải tháng, Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ thông báo cho khách hàng trúng thưởng theo các phương thức sau:<br> +&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Gọi điện thoại thông báo cho khách hàng từ một trong các Số điện thoại sau:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;&nbsp; 08.3962 1501/ 08.3962 1502<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;&nbsp; 0511.3848 999<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;*&nbsp;&nbsp; 04.3782 3151<br> Tần suất và thời gian gọi điện thoại tối đa cho một thuê bao như sau: 03 lần một ngày trong 5 ngày làm việc liên tục, trong khoảng thời gian từ 8h00 sáng tới 20h00 tối.<br> +&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;Nhắn tin từ đầu số 090 với nội dung:<br> <em>”MobiFone chúc mừng quý khách đã trúng thưởng giải X- CTKM Rinh lộc phát tài. Quý khách truy cập website </em><a href="{cache}"><em>{cache}</em></a><em> để biết chi tiết”</em><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Đối với giải thưởng bằng tiền mặt: Giải thưởng sẽ được chuyển khoản cho khách hàng trúng giải qua tài khoản ngân hàng. Khách hàng cần cung cấp tài khoản mở tại các ngân hàng được phép hoạt động trên lãnh thổ Việt Nam để nhận thưởng. Khách hàng trúng giải đến làm thủ tục nhận thưởng tại cửa hàng MobiFone.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Khách hàng trúng thưởng cần chuẩn bị các giấy tờ sau để làm thủ tục nhận thưởng:<br> +&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp thuê bao đứng tên cá nhân:</li>\r\n</ol>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p>1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p>02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p>01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp thuê bao đứng tên tổ chức:</p>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p>1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p>02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p>01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>5</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản của tổ chức</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;+&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:</p>\r\n<table align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p>&nbsp;</p>\r\n<p>2</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p>02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p>01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Vào thời điểm nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động 2 chiều và có thông tin cá nhân trùng với thông tin thuê bao đã đăng ký với Tổng Công ty Viễn thông MobiFone .<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sau thời điểm công bố trúng thưởng, nếu khách hàng chuyển quyền sở hữu số thuê bao trúng thưởng cho nhau, thì chủ sở hữu thuê bao cũ (trước thời điểm chuyển quyền) không được quyền nhận thưởng; chủ sở hữu mới (sau thời điểm chuyển quyền) khi đó được quyền nhận thưởng nếu đáp ứng đầy đủ các điều kiện sau:<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Có sở hữu thẻ SIM chứa số thuê bao trúng giải;<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Có văn bản thỏa thuận chuyển nhượng quyền sở hữu thuê bao, có sự chứng kiến của đại diện MobiFone;<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Có văn bản đồng ý của chủ sở hữu cũ về việc được quyền sở hữu giải thưởng phát sinh từ số thuê bao trúng thưởng CTKM này;<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Còn trong thời hạn trao thưởng của CTKM này;<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Các điều kiện khác đươc quy định tại thể lệ của CTKM này.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nếu không đáp ứng được các tiêu chuẩn trên, chủ sở hữu mới không được quyền nhận thưởng. Khi đó giải thưởng được coi là giải thưởng không có người nhận; ban tổ chức CTKM có trách nhiệm xử lý giải thưởng theo đúng quy định hiện hành.<br> <br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng Công ty Viễn thông MobiFone.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.<br> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Thời hạn cuối cùng Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.</p>\r\n<ol start="18">\r\n<li><strong>Trách nhiệm thông báo:</strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại, danh sách khách hàng trúng thưởng trên website chính thức của MobiFone và website của chương trình</li>\r\n</ol><ol start="19">\r\n<li><strong>Quy định khác </strong><br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone và Tổng Công ty Viễn thông MobiFone được toàn quyền sử dụng thông tin cá nhân của khách hàng trúng giải (họ tên, tuổi, số điện thoại, địa chỉ, hình ảnh, giọng nói...) cho mục đích quảng cáo thương mại mà không phải trả chi phí.<br> -&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</li>\r\n</ol>', '', '', 'vn', 1);
INSERT INTO `cms_pages` (`id`, `slug`, `title`, `content`, `meta_keywords`, `meta_description`, `lang`, `enabled`) VALUES
(14, 'terms_4', 'Rinh Lộc Phát Tài 4', '<p align="center"><strong>PHỤ LỤC 01: NỘI DUNG CHƯƠNG TRÌNH KHUYẾN MẠI </strong></p>\r\n<p><strong>1. Tên</strong><strong> chương trình: </strong>Rinh lộc phát tài</p>\r\n<p><strong>2. Thời</strong><strong> gian triển khai:</strong></p>\r\n<p>Từ 15h00 ngày 09/07/2017 đến 23h59:59 ngày 06/10/2017 (90 ngày)<br> (Kết thúc CTKM các gói cước tiếp tục được cung cấp đến khách hàng)</p>\r\n<p><strong>3. Hàng hóa, dịch vụ áp dụng khuyến mại:</strong> Gói Văn hóa và gói Du lịch.</p>\r\n<p><strong>4. Đầu số:</strong>678</p>\r\n<p><strong>5. Website dịch vụ: </strong>{cache}</p>\r\n<p><strong>6. Phạm vi khuyến mại: </strong>Toàn quốc</p>\r\n<p><strong>7. Đối tượng và quy định </strong></p>\r\n<ul>\r\n<li>Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:</li>\r\n<ul>\r\n<li>Các thuê bao có tham gia chương trình khuyến mại Rinh lộc phát tài giai đoạn 3</li>\r\n<li>Các thuê bao đăng ký mới gói Văn hóa và gói Du lịch từ ngày 09/07/2017</li>\r\n</ul>\r\n<li>Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ul>\r\n<p><strong>8. Cơ cấu giải thưởng: </strong></p>\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Loại giải</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Đơn giá</strong> <strong>(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thành tiền</strong> <strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải đồng hành<br> (120 giải/ngày)</p>\r\n</td>\r\n<td>\r\n<p align="center">Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p align="right">20.000</p>\r\n</td>\r\n<td>\r\n<p align="center">10.800</p>\r\n</td>\r\n<td>\r\n<p align="right">216.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải tháng <br> (01 giải/tháng)</p>\r\n</td>\r\n<td>\r\n<p align="center">Iphone 7 Plus 128GB</p>\r\n</td>\r\n<td>\r\n<p align="right">24.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="right">72.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải chung cuộc</p>\r\n</td>\r\n<td>\r\n<p align="center">Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="right">110.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="right">110.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4">\r\n<p align="center"><strong>Tổng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>10.804</strong></p>\r\n</td>\r\n<td>\r\n<p align="right"><strong>398.000.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align="right"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><em>(Bằng chữ: </em><em>Ba trăm chín mươi </em><em>tám </em><em>triệu đồng</em><em>./.)</em></p>\r\n<p><strong>9. Cách tham gia:</strong></p>\r\n<ul>\r\n<li><strong><em>9.1 Với các thuê bao đã tham gia CTKM&nbsp; Rinh lộc phát tài giai đoạn 3</em></strong>\r\n<ul>\r\n<li>Khách hàng không cần đăng ký lại, hệ thống sẽ tự động gia hạn theo quy định hiện hành.</li>\r\n<li>Các thuê bao đã tham gia Rinh lộc phát tài giai đoạn 03, nếu trừ cước thành công gói “Văn hóa” trong ngày&nbsp; 09/07/2017 sẽ được cộng 2.000 điểm vào ngày hôm đó.</li>\r\n<li>Hệ thống nhắn tin thông báo cho khách hàng duy trì thành công gói cước của dịch vụ, trường hợp thuê bao sử dụng nhiều gói cước chỉ nhận 1 tin thông báo: “CTKM Rinh loc phat tai se duoc gia han tu 15h ngay 09/07/2017 den ngay 06/10/2017. Quy khach hay tiep tuc tham gia CTKM de co co hoi&nbsp; trung thuong dien thoai iPhone 7 Plus moi thang va giai chung cuoc 110 TRIEU DONG. Chi tiet quy khach goi 9090 hoac truy cap website {cache}"</li>\r\n</ul>\r\n</li>\r\n<li><strong><em>9.2 Với các thuê bao chưa từng đăng ký hoặc đã đăng ký, nhưng hủy trước thời gian khuyến mại:<br> </em></strong>Để tham gia CTKM, khách hàng có thể lựa chọn đăng ký gói cước qua các kênh sau:</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Kênh</strong><strong> SMS:</strong></li>\r\n<ul>\r\n<li>Gói Văn hóa: Soạn DK VH hoặc VH hoặc OK gửi 678</li>\r\n<li>Gói Du lịch: Soạn DK DL hoặc GO hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.</li>\r\n</ul>\r\n<li><strong>Kênh</strong><strong> USSD:</strong></li>\r\n<ul>\r\n<li>Gói Văn hóa: *678# (nhấn nút gọi). Sau đó nhấn 1 và gửi để đăng kí hoặc bấm *678*1# (nhấn nút gọi)</li>\r\n</ul>\r\n<li><strong>Kênh</strong><strong> wapsite sử dụng 3G/GPRS mạng MobiFone</strong></li>\r\n<ul>\r\n<li>Gói Văn hóa:\r\n<ul>\r\n<li>Bước 1: Khách hàng bấm vào các banner quảng cáo về CTKM</li>\r\n<li>Bước 2: Khách hàng bấm đồng ý trên trang xác thực MobiFone <a href="http://dangky.mobifone.vn">http://dangky.mobifone.vn</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<li>Sau khi đăng ký thành công, nếu khách hàng không hủy, chương trình sẽ gia hạn hàng ngày các gói cước.</li>\r\n</ul>\r\n<p><strong>10. Thông</strong><strong> tin chi tiết về gói Văn hóa:</strong></p>\r\n<ul>\r\n<li><strong>Nội</strong><strong> dung gói:</strong> Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</li>\r\n<li><strong>Quyền</strong><strong> lợi hàng ngày</strong><strong>:</strong></li>\r\n<ul>\r\n<li>Khách hàng được nhận bản tin của gói cước hàng ngày.</li>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ được nhận 05 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi hoàn toàn miễn phí</li>\r\n</ul>\r\n<li><strong>Quy định về điểm tích lũy gói Văn hóa:</strong></li>\r\n</ul>\r\n<div align="center">\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">Đăng ký thành công/ gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="center">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">Phản hồi lời mời tham gia gói “Du lịch”</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li><strong>Giá cước gói Văn hóa:</strong></li>\r\n<ul>\r\n<li>Với các khách hàng đăng ký mới: Được sử dụng miễn phí gói cước trong 03 ngày đầu tiên.</li>\r\n<li>Với các khách hàng đồng ý tham gia chương trình giai đoạn 3: Khách hàng được sử dụng miễn phí gói cước trong 03 ngày gia hạn đầu tiên.</li>\r\n<li>Sau thời gian miễn phí, mức cước: 6.000 đồng mỗi ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng: Đăng ký, Hủy, Trả lời câu hỏi, Tra cứu điểm... đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>11. Thông</strong><strong> tin về gói Du lịch</strong><strong>:</strong></p>\r\n<ul>\r\n<li>Đối tượng: Các thuê bao đang sử dụng gói Văn hóa.</li>\r\n<li>Nội dung: Cung cấp các câu hỏi về du lịch, các điểm đến thú vị trên thế giới.</li>\r\n<li>Cách tham gia: Khách hàng chủ động soạn tin DK DL/GO/DX gửi 678<br> <br> Hoặc xác nhận việc sử dụng gói “Du lịch” bằng cách soạn 1 hoặc 2 gửi 678 sau khi nhận được SMS mời tham gia sử dụng gói “Du lịch” của chương trình (sau khi trả lời xong câu hỏi thứ 2 hoặc câu hỏi thứ 5 của gói “Văn hóa”)</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Quyền</strong><strong> lợi hàng ngày:</strong></li>\r\n<ul>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n<li>Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói Du lịch:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ nhận được 03 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi là hoàn toàn miễn phí</li>\r\n</ul>\r\n<li><strong>Quy định về điểm tích lũy gói Du lịch:</strong></li>\r\n</ul>\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công/gia hạn thành công</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="center">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li><strong>Giá cước gói Du lịch:</strong></li>\r\n<ul>\r\n<li>Mức cước 3.000 đồng/ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu điểm...đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>12. Quy</strong><strong> định về 3 ngày miễn phí </strong></p>\r\n<ul>\r\n<li>Mỗi thuê bao có 03 ngày trải nghiệm miễn phí đầu tiên cho gói ”Văn hóa”</li>\r\n<li>Gói”Du lịch” không có 03 ngày trải nghiệm miễn phí.</li>\r\n<li>03 ngày đầu tiên được tính là 03 ngày đầu sử dụng mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian miễn phí 03 ngày đầu tiên kể từ lần đầu tiên, nếu khách hàng hủy và đăng ký lại (lần thứ 2), khách hàng sẽ không bị trừ cước ở lần đăng ký tiếp theo.</li>\r\n<li>Trong trường hợp khách hàng hủy trong thời gian 03 ngày miễn phí và đăng ký lại vào ngày thứ 4, khách hàng cũng sẽ không được hưởng nốt thời gian miễn phí còn lại của 03 ngày đầu tiên.</li>\r\n<li>Trong thời gian miễn phí, khách hàng không bị tính cước và vẫn được duy trì các quyền lợi của gói cước.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n<li>Ngày được tính là một ngày theo lịch dương.</li>\r\n</ul>\r\n<p><strong>13. Quy</strong><strong> định về phương thức tính cước chung của chương trình</strong></p>\r\n<ul>\r\n<li><strong><em>13.1 Khách hàng chỉ sử dụng gói cước </em></strong><strong><em>Văn hóa</em></strong>\r\n<ul>\r\n<li>Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:&nbsp;</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<div align="center">\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥6.000 đồng <br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 6.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li><strong><em>13.2 Khách hàng sử dụng cả 2 gói cước Văn hóa&nbsp; và Du lịch</em></strong>\r\n<ul>\r\n<li>Gói cước Văn hóa còn thời gian miễn phí:</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥1.500 đồng <br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>Gói cước Văn hóa hết thời gian miễn phí:</li>\r\n</ul>\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥9.000 đồng<br> <em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥4.500 đồng<br> <em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">6.000 đồng ≤ TKC &lt; 9.000 đồng<br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 4.500 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 6.000 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">1.500 đồng ≤ TKC &lt; 3.000 đồng<br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li><strong><em>13.3Quy định chung</em></strong>\r\n<ul>\r\n<li>Trong một ngày, hệ thống chỉ tính cước mỗi gói tin theo các mức cước trên. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó.</li>\r\n<li>Tại thời điểm gia hạn, nếu khách hàng sử dụng đồng thời nhiều gói cước, hệ thống sẽ tiến hành trừ cước từng gói theo thứ tự lần lượt là: (1) gói Văn hóa; (2) gói Du lịch.</li>\r\n<li>Cước của gói được trừ vào tài khoản chính với thuê bao trả trước và ghi vào hóa đơn cước với thuê bao trả sau.</li>\r\n<li>Tại thời điểm gia hạn gói cước, nếu tài khoản chính của thuê bao trả trước không đủ ở mức dưới, hệ thống sẽ tiếp tục trừ cước tối đa 01 lần/ ngày và tuân theo quy định tối ưu trừ cước như sau:\r\n<ul>\r\n<li>Bước 1: Hệ thống trừ cước khi đăng ký/gia hạn thành công hàng ngày: Trừ cước hàng ngày, theo bậc thang.</li>\r\n<li>Bước 2: Hệ thống kiểm tra các thuê bao trừ cước không thành công liên tục trong 03 ngày sẽ xử lý:</li>\r\n<li>Các ngày sau hệ thống chỉ trừ cước 01 lần/ngày với mức cước thấp nhất của bậc thang gói dịch vụ.</li>\r\n<li>Nếu trừ được cước của thuê bao hệ thống sẽ trừ cước như bình thường như bước đầu trong các ngày tiếp theo.</li>\r\n<li>Nếu trừ cước không thành công trong 30 ngày liên tiếp hệ thống sẽ hủy dịch vụ cho thuê bao.</li>\r\n</ul>\r\n</li>\r\n<li>Ngoài ra hệ thống có thể sử dụng bản tin NEIF để trừ cước: Thuê bao trừ cước không thành công trong lần trừ cước đầu tiên trong ngày, hệ thống chỉ được phép retry trừ cước trong ngày khi nhận được bản tin NEIF thông báo thuê bao đã nạp tiền.</li>\r\n<li>Khi thuê bao gia hạn:\r\n<ul>\r\n<li>Trường hợp trừ cước thành công, khách hàng tiếp tục sử dụng dịch vụ bình thường.</li>\r\n<li>Trường hợp thử trừ cước không thành công, khách hàng sẽ không nhận được gói tin, không nhận được điểm tích luỹ nhưng vẫn được tiếp tục duy trì gói cước.</li>\r\n<li>Trường hợp không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ tiến hành huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng phải tiến hành đăng ký lại.</li>\r\n</ul>\r\n</li>\r\n<li>Trường hợp thuê bao bị khoá 01 chiều, hệ thống sẽ tạm dừng cung cấp gói cho đến khi thuê bao hoạt động 02 chiều trở lại, điểm thưởng của khách hàng vẫn được bảo lưu. (Trong thời gian thuê bao bị chặn 01 chiều, hệ thống sẽ không trừ cước, không trả điểm và mã dự thưởng cho thuê bao đó. Sau khi thuê bao hoạt động 02 chiều trở lại, hệ thống sẽ mở lại gói và không trừ bù tiền của khách hàng trong thời gian bị khoá 01 chiều đó).</li>\r\n<li>Trường hợp thuê bao bị khóa 2 chiều, hệ thống sẽ tự động hủy gói của khách hàng, đồng thời toàn bộ điểm và mã dự thưởng của thuê bao tích lũy trước đó sẽ không được bảo lưu. Khi đó, khách hàng muốn sử dụng gói phải tự đăng ký lại.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>14. Cách</strong><strong> hủy gói cước:</strong></p>\r\n<ul>\r\n<li>Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.</li>\r\n<li>Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.</li>\r\n<li>Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</li>\r\n</ul>\r\n<p><strong>15. Cách thức xếp hạng thuê bao trong CTKM:</strong></p>\r\n<p>Cuối mỗi chu kỳ xét thưởng (ngày/tháng/chung cuộc), chương trình sẽ xếp hạng thuê bao theo các tiêu chí có mức độ ưu tiên giảm dần như sau:</p>\r\n<ul>\r\n<li>Điểm số tích lũy của thuê bao trong chu kỳ đó theo thứ hạng từ cao xuống thấp;</li>\r\n<li>Thời gian đạt được điểm tích lũy đó theo thứ hạng từ nhanh đến chậm. Trong đó, thời gian đạt điểm được tính kể từ thời điểm hệ thống nhận được câu trả lời đầu tiên trong ngày đến thời điểm hệ thống nhận được câu trả lời cuối cùng của ngày đó. Với chu kỳ tháng, thời gian được tính bằng tổng thời gian của 30 ngày.</li>\r\n<li>Thời điểm đăng ký gói cước Văn hóa (tính từ ngày cung cấp gói cước)</li>\r\n<li>Các thuê bao đã được đánh số theo thứ tự tăng dần, bắt đầu từ thuê bao có thành tích tốt nhất.<br> <br> Ví dụ về bảng tổng sắp thứ tự thuê bao:</li>\r\n</ul>\r\n<div align="center">\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td><br> <strong>Thuê bao</strong></td>\r\n<td>\r\n<p align="center"><strong>Điểm tích lũy trong chu kỳ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thời gian đăng ký</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Xếp hạng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">A</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">12/11/2015 15:11:10</p>\r\n</td>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">B</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">23/11/2015 20:11:10</p>\r\n</td>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">C</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">28/01/2016 23:11:18</p>\r\n</td>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">D</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">11/07/2016 23:56:18</p>\r\n</td>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">E</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">18/07/2016 21:58:18</p>\r\n</td>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">F</p>\r\n</td>\r\n<td>\r\n<p align="center">800</p>\r\n</td>\r\n<td>\r\n<p align="center">19/09/2016 21:16:18</p>\r\n</td>\r\n<td>\r\n<p align="center">6</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong>16. Cách thức xác định khách hàng trúng giải</strong></p>\r\n<ul>\r\n<li><strong>Giải chung cuộc: </strong></li>\r\n<ul>\r\n<li>Giải chung cuộc được trao cho thuê bao xếp hạng thứ 1 trong toàn chương trình.</li>\r\n</ul>\r\n<li><strong>Giải</strong><strong> Tháng:</strong></li>\r\n<li>Giải tháng được trao cho thuê bao xếp hạng thứ 10 trong tháng đó<br> <br> <strong>Chú ý: </strong>01 thuê bao và 01 cá nhân đứng tên chỉ được trúng giải 01 tháng duy nhất trong suốt CTKM. Nếu thuê bao hoặc cá nhân đã trúng giải của tháng trước, đủ điều kiện trúng giải tháng khác, thì giải tháng khác sẽ được trao cho thuê bao xếp hạng liền sau.</li>\r\n<li><strong>Giải</strong><strong> Đồng hành: áp dụng với thuê bao đăng ký mới <br> <br> </strong>Thuê bao trúng thưởng thỏa mãn đủ 2 điều kiện sau:\r\n<ul>\r\n<li>120 thuê bao đầu tiên đăng ký mới gói ”Văn hóa” trong ngày đó (chỉ áp dụng với thuê bao đăng ký lần đầu trong CTKM)</li>\r\n<li>Có trừ cước thành công gói ”Văn hóa” 1 ngày sau 3 ngày miễn phí</li>\r\n<li>Tần suất công bố danh sách trúng thưởng: 07 ngày/lần</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong>17. Thời gian, Địa điểm và thủ tục trao thưởng:</strong></p>\r\n<ul>\r\n<li>Sau khi có kết quả trúng thưởng, danh sách khách hàng trúng thưởng sẽ được đăng tải trên website chính thức của MobiFone và website của chương trình. Khách hàng có thể chủ động truy cập vào các địa chỉ trên để biết thông tin trúng thưởng.</li>\r\n<li>Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ công bố công khai điểm số trúng thưởng. Các số điện thoại trúng thưởng sẽ được giấu 02 chữ số cuối, nhằm đảm bảo tính bảo mật cá nhân của người trúng giải.</li>\r\n<li>Đối với giải thưởng bằng thẻ cào MobiFone: Giải thưởng sẽ được chuyển tới khách hàng thông qua hình thức nạp tiền trực tuyến</li>\r\n<li>Đối với các khách hàng trúng giải tháng/chung cuộc, Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ thông báo cho khách hàng trúng thưởng theo các phương thức sau:</li>\r\n<ul>\r\n<li>&nbsp;Gọi điện thoại thông báo cho khách hàng từ một trong các Số điện thoại sau:\r\n<ul>\r\n<li>08.3962 1501/ 08.3962 1502</li>\r\n<li>0511.3848 999</li>\r\n<li>04.3782 3151</li>\r\n</ul>\r\n</li>\r\n<li>Tần suất và thời gian gọi điện thoại tối đa cho một thuê bao như sau: 03 lần một ngày trong 5 ngày làm việc liên tục, trong khoảng thời gian từ 8h00 sáng tới 20h00 tối.</li>\r\n<li>&nbsp;Nhắn tin từ đầu số 090 với nội dung: “<em>MobiFone chúc mừng quý khách đã trúng thưởng giả</em><em>i X- CTKM Rinh lộc phát tài</em><em>. Quý khách truy cập website </em><a href="{cache}"><em>{cache}</em></a><em> để biết chi tiết”</em></li>\r\n</ul>\r\n<li>Đối với giải thưởng bằng tiền mặt: Giải thưởng sẽ được chuyển khoản cho khách hàng trúng giải qua tài khoản ngân hàng. Khách hàng cần cung cấp tài khoản mở tại các ngân hàng được phép hoạt động trên lãnh thổ Việt Nam để nhận thưởng. Khách hàng trúng giải đến làm thủ tục nhận thưởng tại cửa hàng MobiFone.</li>\r\n<li>Đối với giải thưởng bằng hiện vật: Khách hàng trúng giải đến làm thủ tục nhận thưởng giải hiện vật tại các gian hàng tư vấn dịch vụ của MobiFone trên toàn quốc.</li>\r\n<li>Khách hàng trúng thưởng cần chuẩn bị các giấy tờ sau để làm thủ tục nhận thưởng:</li>\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên cá nhân:</li>\r\n</ul>\r\n</ul>\r\n<div align="center">\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên tổ chức:</li>\r\n</ul>\r\n</ul>\r\n<div align="center">\r\n<table border="0" width="595" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td width="47">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="255">\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td width="217">\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td width="76">\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2" width="47">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2" width="255">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="217">\r\n<p>Bản gốc</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="255">\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="255">\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td width="217">\r\n<p>SIM đăng ký thông tin của người nhận giải</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">4</p>\r\n</td>\r\n<td width="255">\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng của tổ chức</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">5</p>\r\n</td>\r\n<td width="255">\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản của tổ chức</p>\r\n</td>\r\n<td width="217">\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<ul>\r\n<li>Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:</li>\r\n</ul>\r\n</ul>\r\n<table border="0" cellspacing="2" cellpadding="2" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">&nbsp;</p>\r\n<p align="center">2</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<ul>\r\n<li>Vào thời điểm nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động 2 chiều và có thông tin cá nhân trùng với thông tin thuê bao đã đăng ký với Tổng Công ty Viễn thông MobiFone .</li>\r\n<li>Sau thời điểm công bố trúng thưởng, nếu khách hàng chuyển quyền sở hữu số thuê bao trúng thưởng cho nhau, thì chủ sở hữu thuê bao cũ (trước thời điểm chuyển quyền) không được quyền nhận thưởng; chủ sở hữu mới (sau thời điểm chuyển quyền) khi đó được quyền nhận thưởng nếu đáp ứng đầy đủ các điều kiện sau:</li>\r\n<ul>\r\n<li>Có sở hữu thẻ SIM chứa số thuê bao trúng giải;</li>\r\n<li>Có văn bản thỏa thuận chuyển nhượng quyền sở hữu thuê bao, có sự chứng kiến của đại diện MobiFone;</li>\r\n<li>Có văn bản đồng ý của chủ sở hữu cũ về việc được quyền sở hữu giải thưởng phát sinh từ số thuê bao trúng thưởng CTKM này;</li>\r\n<li>Còn trong thời hạn trao thưởng của CTKM này;</li>\r\n<li>Các điều kiện khác đươc quy định tại thể lệ của CTKM này.</li>\r\n<li>Nếu không đáp ứng được các tiêu chuẩn trên, chủ sở hữu mới không được quyền nhận thưởng. Khi đó giải thưởng được coi là giải thưởng không có người nhận; ban tổ chức CTKM có trách nhiệm xử lý giải thưởng theo đúng quy định hiện hành.</li>\r\n</ul>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng Công ty Viễn thông MobiFone.</li>\r\n<li>Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).</li>\r\n<li>Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.</li>\r\n<li>Thời hạn cuối cùng Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.</li>\r\n</ul>\r\n<p><strong>18. Trách</strong><strong> nhiệm thông báo:</strong></p>\r\n<ul>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại, danh sách khách hàng trúng thưởng trên website chính thức của MobiFone và website của chương trình</li>\r\n</ul>\r\n<p><strong>19. Quy định khác </strong></p>\r\n<ul>\r\n<li>Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.</li>\r\n<li>Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.</li>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone và Tổng Công ty Viễn thông MobiFone được toàn quyền sử dụng thông tin cá nhân của khách hàng trúng giải (họ tên, tuổi, số điện thoại, địa chỉ, hình ảnh, giọng nói...) cho mục đích quảng cáo thương mại mà không phải trả chi phí.</li>\r\n<li>Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</li>\r\n</ul>', '', '', 'vn', 1);
