(15, 'terms_5', 'Rinh Lộc Phát Tài 5', '<p align="center"><strong>NỘI DUNG CHƯƠNG TRÌNH KHUYẾN MẠI</strong></p>\r\n<p><strong>1. Thời</strong><strong> gian triển khai: </strong>Từ 00h00 ngày 07/10/2017 đến 23h59:59 ngày 04/01/2018 (90 ngày)<br> (Kết thúc CTKM các gói cước tiếp tục được cung cấp đến khách hàng)</p>\r\n<p><strong>2. Hàng hóa, dịch vụ áp dụng khuyến mại:</strong> Gói Văn hóa và gói Du lịch.</p>\r\n<p><strong>3. Đầu số: </strong>678</p>\r\n<p><strong>4. Website dịch vụ: </strong>{cache}</p>\r\n<p><strong>5. Phạm vi khuyến mại: </strong>Toàn quốc</p>\r\n<p><strong>6. Đối tượng và quy định </strong></p>\r\n<ul>\r\n<li>Chương trình áp dụng đối với các thuê bao trả trước và trả sau hoạt động hai chiều trên mạng MobiFone:</li>\r\n<ul>\r\n<li>Các thuê bao có tham gia chương trình khuyến mại Rinh lộc phát tài giai đoạn 4</li>\r\n<li>Các thuê bao đăng ký mới gói Văn hóa và gói Du lịch từ ngày 07/10/2017</li>\r\n</ul>\r\n<li>Các thuê bao Fast Connect và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng Công ty Viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</li>\r\n</ul>\r\n<p><strong>7. Cơ cấu giải thưởng: </strong></p>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Loại giải</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Đơn giá</strong> <br> <strong>(VND)</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thành tiền</strong> <br> <strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải đồng hành<br> (120 giải/ngày)</p>\r\n</td>\r\n<td>\r\n<p align="center">Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td>\r\n<p align="right">20.000</p>\r\n</td>\r\n<td>\r\n<p align="center">10.800</p>\r\n</td>\r\n<td>\r\n<p align="right">216.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải tháng <br> (01 giải/tháng)</p>\r\n</td>\r\n<td>\r\n<p align="center">Điện thoại iPhone 8 64GB</p>\r\n</td>\r\n<td>\r\n<p align="right">26.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="right">78.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="left">Giải chung cuộc</p>\r\n</td>\r\n<td>\r\n<p align="center">Tiền mặt</p>\r\n</td>\r\n<td>\r\n<p align="right">110.000.000</p>\r\n</td>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="right">110.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4">\r\n<p align="center"><strong>Tổng</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>10.804</strong></p>\r\n</td>\r\n<td>\r\n<p align="right"><strong>404</strong><strong>.000.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p align="right"><strong>&nbsp; </strong><em>(Bằng chữ: </em><em>Bốn trăm linh bốn triệu </em><em>đồng</em><em>)</em></p>\r\n<p><strong>8. Cách tham gia:</strong></p>\r\n<p><strong> <em>8.1 Với các thuê bao đã tham gia CTKM&nbsp; Rinh lộc phát tài giai đoạn 4</em></strong></p>\r\n<ul>\r\n<li>Khách hàng không cần đăng ký lại, hệ thống sẽ tự động gia hạn theo quy định hiện hành.</li>\r\n<li>Các thuê bao đã tham gia Rinh lộc phát tài giai đoạn 04, nếu trừ cước thành công gói “Văn hóa” trong ngày 07/10/2017 sẽ được cộng 2.000 điểm vào ngày hôm sau.</li>\r\n<li>Hệ thống nhắn tin thông báo cho khách hàng duy trì thành công gói cước của dịch vụ,: “CTKM Rinh loc phat tai se duoc tiep tuc gia han tu ngay 07/10/2017 den ngay 04/01/2018. Quy khach duy tri thanh cong cac goi cuoc Van hoa, Du lich se co co hoi so huu 110 Trieu dong tien mat. Chi tiet quy khach goi 9090 hoac truy cap website {cache}"</li>\r\n</ul>\r\n<p><strong><em>8.2 Với các thuê bao chưa từng đăng ký hoặc đã đăng ký, nhưng hủy trước thời gian khuyến mại:</em></strong></p>\r\n<p>Để tham gia CTKM, khách hàng có thể lựa chọn đăng ký gói cước qua các kênh sau:</p>\r\n<ul>\r\n<li><strong>Kênh SMS:</strong></li>\r\n<ul>\r\n<li>Gói Văn hóa: Soạn DK VH hoặc VH hoặc DK gửi 678</li>\r\n<li>Gói Du lịch: Soạn DK DL hoặc GO hoặc DX gửi 678, sau khi đã đăng ký gói Văn hóa.</li>\r\n</ul>\r\n<li><strong>Kênh</strong><strong> USSD:</strong></li>\r\n<ul>\r\n<li>Gói Văn hóa: Bấm *678# và phím gọi</li>\r\n</ul>\r\n<li><strong>Kênh</strong><strong> wapsite </strong></li>\r\n<ul>\r\n<li>Gói Văn hóa:\r\n<ul>\r\n<li>Bước 1: Khách hàng bấm vào các banner quảng cáo về CTKM</li>\r\n<li>Bước 2: Khách hàng bấm đồng ý trên trang xác thực MobiFone <a href="http://dangky.mobifone.vn" target="_blank">http://dangky.mobifone.vn</a></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<li>Sau khi đăng ký thành công, nếu khách hàng không hủy, chương trình sẽ gia hạn hàng ngày các gói cước.</li>\r\n</ul>\r\n<p><strong>9. Thông</strong><strong> tin chi tiết về gói Văn hóa:</strong></p>\r\n<ul>\r\n<li><strong>Nội</strong><strong> dung gói:</strong> Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</li>\r\n<li><strong>Quyền</strong><strong> lợi hàng ngày</strong><strong>:</strong></li>\r\n<ul>\r\n<li>Khách hàng được nhận bản tin của gói cước hàng ngày.</li>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ được nhận 05 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi hoàn toàn miễn phí</li>\r\n</ul>\r\n<li><strong>Quy định về điểm tích lũy gói Văn hóa:</strong></li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">I</p>\r\n</td>\r\n<td>\r\n<p align="left"><strong>Thuê bao có sử sử dụng gói Văn hóa ngày 06/10/2017</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>&nbsp;</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="left">Gia hạn thành công ngày 07/10/2017</p>\r\n</td>\r\n<td>\r\n<p align="left">Cộng 2.000 điểm trong ngày 08/10/2017</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">II</p>\r\n</td>\r\n<td>\r\n<p align="left"><strong>Các thuê bao còn lại</strong></p>\r\n</td>\r\n<td>\r\n<p align="left">&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="left">Đăng ký lần đầu thành công</p>\r\n</td>\r\n<td>\r\n<p align="left">100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="left">Gia hạn thành công gói cước hoặc đăng ký lại thành công vào ngày hôm sau</p>\r\n</td>\r\n<td>\r\n<p align="left">100 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="left">Đăng ký lại ngay trong ngày</p>\r\n</td>\r\n<td>\r\n<p align="left">0 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">III</p>\r\n</td>\r\n<td>\r\n<p align="left">Áp dụng chung cho tất cả các thuê bao</p>\r\n</td>\r\n<td>\r\n<p align="left">&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="left">Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="left">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="left">Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="left">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="left">Đồng ý nhận lời mời tham gia gói “Du lịch” lần đầu tiên</p>\r\n</td>\r\n<td>\r\n<p align="left">100 điểm</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li><strong>Cước gói Văn hóa:</strong></li>\r\n<ul>\r\n<li>Với các khách hàng đăng ký mới: Được sử dụng miễn phí gói cước trong 03 ngày đầu tiên. Sau thời gian miễn phí, mức cước: 6.000 đồng mỗi ngày (đã bao gồm VAT).</li>\r\n<li>Với khách hàng đăng ký lại và tiếp tục gia hạn sử dụng dịch vụ cước phí: 6.000 đ/ngày ( đã bao gồm VAT)</li>\r\n<li>Mọi thao tác khác của khách hàng: Đăng ký, Hủy, Trả lời câu hỏi, Tra cứu điểm... đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>10. Thông</strong><strong> tin về gói Du lịch</strong><strong>:</strong></p>\r\n<ul>\r\n<li>Đối tượng: Các thuê bao đang sử dụng gói Văn hóa.</li>\r\n<li>Nội dung: Cung cấp các câu hỏi về du lịch, các điểm đến thú vị trên thế giới.</li>\r\n<li><strong>Quyền</strong><strong> lợi hàng ngày:</strong></li>\r\n<ul>\r\n<li>Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</li>\r\n<li>Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.</li>\r\n</ul>\r\n<li><strong>Các câu hỏi của gói Du lịch:</strong></li>\r\n<ul>\r\n<li>Hàng ngày, khách hàng sẽ nhận được 03 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</li>\r\n<li>Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</li>\r\n<li>Thời gian trả lời câu hỏi không bị giới hạn</li>\r\n<li>Cước trả lời câu hỏi là hoàn toàn miễn phí</li>\r\n</ul>\r\n<li><strong>Quy định về điểm tích lũy gói Du lịch:</strong></li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Đăng ký thành công hoặc gia hạn thành công hoặc tái đăng ký thành công vào ngày hôm sau</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="left">Đăng ký lại ngay trong ngày</p>\r\n</td>\r\n<td>\r\n<p align="center">0 điểm/lần</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td>\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td valign="top">\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td>\r\n<p align="center">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li><strong>Cước gói Du lịch:</strong></li>\r\n<ul>\r\n<li>Mức cước 3.000 đồng/ngày (đã bao gồm VAT).</li>\r\n<li>Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu điểm...đều hoàn toàn miễn phí.</li>\r\n<li>Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>11. Quy</strong><strong> định về 3 ngày miễn phí </strong></p>\r\n<ul>\r\n<li>Các thuê bao lần đầu tiên đăng ký gói Văn hóa sẽ được miễn cước 03 ngày đầu (tính từ ngày gói cước cung cấp trên hệ thống MobiFone)</li>\r\n<li>Gói”Du lịch” không có 03 ngày trải nghiệm miễn phí.</li>\r\n<li>03 ngày đầu tiên được tính là 03 ngày đầu sử dụng mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian miễn phí 03 ngày đầu tiên kể từ lần đầu tiên, nếu khách hàng hủy và đăng ký lại (lần thứ 2), khách hàng sẽ không bị trừ cước ở lần đăng ký tiếp theo.</li>\r\n<li>Trong trường hợp khách hàng hủy trong thời gian 03 ngày miễn phí và đăng ký lại vào ngày thứ 4, khách hàng cũng sẽ không được hưởng nốt thời gian miễn phí còn lại của 03 ngày đầu tiên.</li>\r\n<li>Trong thời gian miễn phí, khách hàng không bị tính cước và vẫn được duy trì các quyền lợi của gói cước.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li>\r\n<li>Ngày được tính là một ngày theo lịch dương.</li>\r\n</ul>\r\n<p><strong>12. Quy</strong><strong> định về phương thức tính cước chung của chương trình</strong></p>\r\n<p><strong><em>12.1 Khách hàng chỉ sử dụng gói cước </em></strong><strong><em>Văn hóa</em></strong></p>\r\n<ul>\r\n<li>Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:&nbsp;</li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥6.000 đồng <br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 6.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong><em>12.2 Khách hàng sử dụng cả 2 gói cước Văn hóa&nbsp; và Du lịch</em></strong></p>\r\n<ul>\r\n<li>Gói cước Văn hóa còn thời gian miễn phí:</li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥3.000 đồng <br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥1.500 đồng <br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li>Gói cước Văn hóa hết thời gian miễn phí:</li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 8:00 đến 20:00</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Trạng thái tài khoản chính từ 20:01 đến 23:59</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥9.000 đồng<br> <em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">TKC ≥4.500 đồng<br> <em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p align="center">6.000 đồng ≤ TKC &lt; 9.000 đồng<br> <em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 4.500 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p align="center">3.000 đồng ≤ TKC &lt; 6.000 đồng<br> <em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">1.500 đồng ≤ TKC &lt; 3.000 đồng<br> <em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 3.000 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">0 ≤ TKC &lt; 1.500 đồng<br> <em>Không trừ cước</em></p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n<td>\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong><em>12.3 Quy định chung</em></strong></p>\r\n<ul>\r\n<li>Trong một ngày, hệ thống chỉ tính cước mỗi gói tin theo các mức cước trên. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó.</li>\r\n<li>Tại thời điểm gia hạn, nếu khách hàng sử dụng đồng thời nhiều gói cước, hệ thống sẽ tiến hành trừ cước từng gói theo thứ tự lần lượt là: (1) gói Văn hóa; (2) gói Du lịch.</li>\r\n<li>Cước của gói được trừ vào tài khoản chính với thuê bao trả trước và ghi vào hóa đơn cước với thuê bao trả sau.</li>\r\n<li>Tại thời điểm gia hạn gói cước, nếu tài khoản chính của thuê bao trả trước không đủ ở mức thấp hơn, hệ thống sẽ tiếp tục trừ cước tối đa 01 lần/ngày và tuân theo quy định tối ưu trừ cước như sau:</li>\r\n<ul>\r\n<li>Bước 1: Hệ thống trừ cước khi đăng ký/gia hạn thành công hàng ngày: Trừ cước hàng ngày, theo bậc thang.</li>\r\n<li>Bước 2: Hệ thống kiểm tra các thuê bao trừ cước không thành công liên tục trong 03 ngày sẽ xử lý:</li>\r\n</ul>\r\n<li>Các ngày sau hệ thống chỉ trừ cước 01 lần/ngày với mức cước thấp nhất của bậc thang gói dịch vụ.</li>\r\n<li>Nếu trừ được cước của thuê bao hệ thống sẽ trừ cước như bình thường như bước đầu trong các ngày tiếp theo.</li>\r\n<li>Nếu trừ cước không thành công trong 30 ngày liên tiếp hệ thống sẽ hủy dịch vụ cho thuê bao.</li>\r\n<ul>\r\n<li>Ngoài ra hệ thống có thể sử dụng bản tin NEIF để trừ cước: Thuê bao trừ cước không thành công trong lần trừ cước đầu tiên trong ngày, hệ thống chỉ được phép retry trừ cước trong ngày khi nhận được bản tin NEIF thông báo thuê bao đã nạp tiền.</li>\r\n</ul>\r\n<li>Khi thuê bao gia hạn:</li>\r\n<ul>\r\n<li>Trường hợp trừ cước thành công, khách hàng tiếp tục sử dụng dịch vụ bình thường.</li>\r\n<li>Trường hợp thử trừ cước không thành công, khách hàng sẽ không nhận được gói tin, không nhận được điểm tích luỹ nhưng vẫn được tiếp tục duy trì gói cước.</li>\r\n<li>Trường hợp không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ tiến hành huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng phải tiến hành đăng ký lại.</li>\r\n</ul>\r\n<li>Trường hợp thuê bao bị khoá 01 chiều, hệ thống sẽ tạm dừng cung cấp gói cho đến khi thuê bao hoạt động 02 chiều trở lại, điểm thưởng của khách hàng vẫn được bảo lưu. (Trong thời gian thuê bao bị chặn 01 chiều, hệ thống sẽ không trừ cước, không trả điểm và mã dự thưởng cho thuê bao đó. Sau khi thuê bao hoạt động 02 chiều trở lại, hệ thống sẽ mở lại gói và không trừ bù tiền của khách hàng trong thời gian bị khoá 01 chiều đó).</li>\r\n<li>Trường hợp thuê bao bị khóa 2 chiều, hệ thống sẽ tự động hủy gói của khách hàng, đồng thời toàn bộ điểm và mã dự thưởng của thuê bao tích lũy trước đó sẽ không được bảo lưu. Khi đó, khách hàng muốn sử dụng gói phải tự đăng ký lại.</li>\r\n</ul>\r\n<p><strong>13. Cách</strong><strong> hủy gói cước:</strong></p>\r\n<ul>\r\n<li>Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.</li>\r\n<li>Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.</li>\r\n<li>Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</li>\r\n</ul>\r\n<p><strong>14. Quy định về việc sử dụng dịch vụ theo trạng thái thuê bao:</strong></p>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Trạng thái thuê bao</strong></p>\r\n</td>\r\n<td valign="top">\r\n<p align="center"><strong>Quy định </strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Khóa 01 chiều, 02 chiều</p>\r\n</td>\r\n<td>\r\n<ul>\r\n<li>Khách hàng tiếp tục sử dụng dịch vụ đến hết chu kỳ đó.</li>\r\n<li>Tạm dừng cung cấp dịch vụ cho khách hàng trong các chu kỳ tiếp theo.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Mở lại các thuê bao khóa 01 chiều, 02 chiều</p>\r\n</td>\r\n<td>\r\n<ul>\r\n<li>TH1: Mở lại ngay trong chu kỳ cũ của gói dịch vụ =&gt; khách hàng tiếp tục sử dụng dịch vụ đến hết chu kỳ đó.</li>\r\n<li>TH2: Mở lại khi chu kỳ cũ đã kết thúc =&gt; Hệ thống trừ cước thuê bao của khách hàng tính từ ngày mở lại đó:</li>\r\n<ul>\r\n<ul>\r\n<li>Trừ cước thành công: Khách hàng tiếp tục sử dụng dịch vụ.</li>\r\n<li>Trừ cước không thành công: Trừ cước lại theo quy định của dịch vụ.</li>\r\n</ul>\r\n</ul>\r\n</ul>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Chuyển đổi giữa các thuê bao trả trước</p>\r\n</td>\r\n<td>\r\n<p>Khách hàng tiếp tục sử dụng dịch vụ theo chu kỳ cũ.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Chuyển đổi thuê bao trả trước sang trả sau và ngược lại</p>\r\n</td>\r\n<td>\r\n<p>Khách hàng tiếp tục sử dụng dịch vụ theo chu kỳ cũ.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n<td>\r\n<p>Thuê bao bị hủy</p>\r\n</td>\r\n<td>\r\n<p>Hủy dịch vụ.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong>15. Quy định thời điểm tương tác:</strong></p>\r\n<ul>\r\n<li>Tất cả các thời điểm được quy định trong chương trình là thời điểm hệ thống ghi nhận giao dịch thành công, không tính theo thời điểm trên thiết bị của khách hàng.</li>\r\n<li>Ban tổ chức chương trình không chịu trách nhiệm về việc gửi, nhận tin nhắn bị chậm, các tương tác trên website/wapsite bị chậm hoặc không thể thực hiện được do các sự cố kỹ thuật từ bên ngoài chương trình hoặc trên thiết bị của khách hàng.</li>\r\n<li>Ngày trong chương trình được quy định là ngày dương lịch, tính từ 0h00 đến 23:59:59 của ngày đó.</li>\r\n</ul>\r\n<p><strong>16. Cách</strong><strong> thức xác định thuê bao trúng thưởng:</strong></p>\r\n<p><em>16.1 Cách thức xếp hạng thuê bao trong CTKM:</em></p>\r\n<p>Cuối mỗi chu kỳ xét thưởng (tháng/chung cuộc), chương trình sẽ xếp hạng thuê bao theo các tiêu chí có mức độ ưu tiên giảm dần như sau:</p>\r\n<ul>\r\n<li>Điểm số tích lũy của thuê bao trong chu kỳ đó theo thứ hạng từ cao xuống thấp.</li>\r\n<li>Thời điểm đăng ký gói cước Văn hóa từ sớm nhất đến muộn nhất (tính từ ngày cung cấp gói cước trên hệ thống MobiFone).</li>\r\n<li>Thời điểm đạt được điểm cuối cùng vào ngày cuối của chu kì từ sớm nhất đến muộn nhất. Trong đó, ngày cuối cùng của chu kỳ được quy định như sau:\r\n<ul>\r\n<li>Giải tháng: Áp dụng vào các ngày thứ 30 trong chu kỳ giải tháng, tính từ ngày đầu triển khai CTKM này.</li>\r\n<li>Giải chung cuộc: Áp dụng với ngày cuối cùng của CTKM này.</li>\r\n</ul>\r\n</li>\r\n<li>Các thuê bao đã được đánh số theo thứ tự tăng dần, bắt đầu từ thuê bao có thành tích tốt nhất.</li>\r\n<li>Ví dụ về bảng tổng sắp thứ tự thuê bao:</li>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>Thuê bao</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Điểm tích lũy trong chu kỳ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Thời điểm đăng ký gói Văn hóa</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Xếp hạng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">A</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">12/11/2015 15:11:10</p>\r\n</td>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">B</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">23/11/2015 20:11:10</p>\r\n</td>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">C</p>\r\n</td>\r\n<td>\r\n<p align="center">1.000</p>\r\n</td>\r\n<td>\r\n<p align="center">28/01/2016 23:11:18</p>\r\n</td>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">D</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">11/07/2016 23:56:18</p>\r\n</td>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">E</p>\r\n</td>\r\n<td>\r\n<p align="center">900</p>\r\n</td>\r\n<td>\r\n<p align="center">18/07/2016 21:58:18</p>\r\n</td>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">F</p>\r\n</td>\r\n<td>\r\n<p align="center">800</p>\r\n</td>\r\n<td>\r\n<p align="center">19/09/2016 21:16:18</p>\r\n</td>\r\n<td>\r\n<p align="center">6</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><em>16.2 Cách thức xác định khách hàng trúng giải</em></p>\r\n<ul>\r\n<li><strong><em>16.2.1 Giải chung cuộc: </em></strong></li>\r\n<ul>\r\n<li>Giải chung cuộc được trao cho thuê bao xếp hạng thứ 50 trong toàn chương trình theo cách thức xếp hạng tại Mục 16.1 nêu trên.</li>\r\n</ul>\r\n<li><strong><em>16.2.2 Giải Tháng:</em></strong></li>\r\n<ul>\r\n<li>Giải tháng được trao cho thuê bao xếp hạng thứ 50 trong tháng đó, theo cách thức xếp hạng tại Mục 3.1. nêu trên.</li>\r\n<li>Chú ý: 01 thuê bao và 01 cá nhân đứng tên chỉ được trúng giải 01 tháng duy nhất trong suốt CTKM. Nếu thuê bao hoặc cá nhân đã trúng giải của tháng trước, đủ điều kiện trúng giải tháng khác, thì giải tháng khác sẽ được trao cho thuê bao xếp hạng liền sau.</li>\r\n</ul>\r\n<li><strong><em>16.2.3 Giải Đồng hành: Áp dụng với thuê bao đăng ký mới </em></strong></li>\r\n</ul>\r\n<p>Giải đồng hành áp dụng cho 120 thuê bao đăng ký mới mỗi ngày và thoải mãn đủ 2 điều kiện sau:</p>\r\n<ul>\r\n<ul>\r\n<li>Thuộc nhóm các thuê bao đầu tiên đăng ký mới gói ”Văn hóa” trong ngày T (chỉ áp dụng với thuê bao đăng ký lần đầu trong CTKM).</li>\r\n<li>Có trừ cước thành công gói ”Văn hóa” sau thời gian miễn phí (vào ngày T+3)</li>\r\n<li>Tần suất công bố danh sách trúng thưởng: 15 ngày/lần trên website chương trình.</li>\r\n<li>Trong trường hợp nếu một ngày không có đủ 120 thuê bao, thì số lượng thuê bao thiếu của ngày đó sẽ được cộng dồn liên tục vào ngày sau.</li>\r\n</ul>\r\n</ul>\r\n<p><strong>17. Thời gian, Địa điểm và thủ tục trao thưởng:</strong></p>\r\n<ul>\r\n<li>Sau khi có kết quả trúng thưởng, danh sách khách hàng trúng thưởng sẽ được đăng tải trên website chính thức của MobiFone và website của chương trình. Khách hàng có thể chủ động truy cập vào các địa chỉ trên để biết thông tin trúng thưởng.</li>\r\n<li>Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ công bố công khai điểm số trúng thưởng. Các số điện thoại trúng thưởng sẽ được giấu 02 chữ số cuối, nhằm đảm bảo tính bảo mật cá nhân của người trúng giải.</li>\r\n<li>Đối với giải thưởng bằng thẻ nạp tiền MobiFone: Giải thưởng sẽ được chuyển tới khách hàng thông qua hình thức nạp tiền trực tuyến</li>\r\n<li>Đối với các khách hàng trúng giải tháng/chung cuộc, Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ thông báo cho khách hàng trúng thưởng theo các phương thức sau:</li>\r\n<ul>\r\n<li>Gọi điện thoại thông báo cho khách hàng từ một trong các Số điện thoại sau:\r\n<ul>\r\n<li>08.3962 1501/ 08.3962 1502</li>\r\n<li>0511.3848 999</li>\r\n<li>04.3782 3151</li>\r\n</ul>\r\n</li>\r\n<li>Tần suất và thời gian gọi điện thoại tối đa cho một thuê bao như sau: 03 lần một ngày trong 5 ngày làm việc liên tục, trong khoảng thời gian từ 8h00 sáng tới 20h00 tối.</li>\r\n<li>&nbsp;Nhắn tin từ đầu số 090 với nội dung: “<em>MobiFone chúc mừng quý khách đã trúng thưởng giả</em><em>i X- CTKM </em><em>Rinh loc phat tai. Quý khách truy cập website </em><a href="{cache}"><em>{cache}</em></a><em> để biết chi tiết”</em></li>\r\n</ul>\r\n<li>Đối với giải thưởng bằng tiền mặt: Giải thưởng sẽ được chuyển khoản cho khách hàng trúng giải qua tài khoản ngân hàng. Khách hàng cần cung cấp tài khoản mở tại các ngân hàng được phép hoạt động trên lãnh thổ Việt Nam để nhận thưởng. Khách hàng trúng giải đến làm thủ tục nhận thưởng tại cửa hàng MobiFone.</li>\r\n<li>Đối với giải thưởng bằng hiện vật: Khách hàng trúng giải đến làm thủ tục nhận thưởng giải hiện vật tại các gian hàng tư vấn dịch vụ của MobiFone trên toàn quốc.</li>\r\n<li>Khách hàng trúng thưởng cần chuẩn bị các giấy tờ sau để làm thủ tục nhận thưởng:</li>\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên cá nhân:</li>\r\n</ul>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">03 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng (đối với thuê bao trúng giải bằng tiền)</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản (đối với thuê bao trúng giải bằng tiền)</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<ul>\r\n<li>Trường hợp thuê bao đứng tên tổ chức:</li>\r\n</ul>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">03 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">2</p>\r\n</td>\r\n<td>\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td>\r\n<p>SIM đăng ký thông tin của chủ thuê bao</p>\r\n</td>\r\n<td>\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">4</p>\r\n</td>\r\n<td>\r\n<p>Giấy tờ xác nhận số tài khoản ngân hàng của tổ chức (đối với thuê bao trúng giải bằng tiền)</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc hoặc bản công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">5</p>\r\n</td>\r\n<td>\r\n<p>Số tài khoản ngân hàng và địa chỉ ngân hàng mở tài khoản của tổ chức (đối với thuê bao trúng giải bằng tiền)</p>\r\n</td>\r\n<td>\r\n<p>Chi tiết đến Chi nhánh mở tài khoản</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản thông tin</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<ul>\r\n<li>Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:</li>\r\n</ul>\r\n</ul>\r\n<div class="table-responsive">\r\n<table class="table" border="0" cellspacing="0" cellpadding="0" align="center">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td>\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">1</p>\r\n</td>\r\n<td>\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td>\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2">\r\n<p align="center">&nbsp;</p>\r\n<p align="center">2</p>\r\n</td>\r\n<td rowspan="2">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td>\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td>\r\n<p align="center">03 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>Bản gốc</p>\r\n</td>\r\n<td>\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p align="center">3</p>\r\n</td>\r\n<td>\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<ul>\r\n<li>Vào thời điểm nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động 2 chiều và có thông tin cá nhân trùng với thông tin thuê bao đã đăng ký với Tổng Công ty Viễn thông MobiFone .</li>\r\n<li>Sau thời điểm công bố trúng thưởng, nếu khách hàng chuyển quyền sở hữu số thuê bao trúng thưởng cho nhau, thì chủ sở hữu thuê bao cũ (trước thời điểm chuyển quyền) không được quyền nhận thưởng; chủ sở hữu mới (sau thời điểm chuyển quyền) khi đó được quyền nhận thưởng nếu đáp ứng đầy đủ các điều kiện sau:</li>\r\n<ul>\r\n<li>Có sở hữu thẻ SIM chứa số thuê bao trúng giải;</li>\r\n<li>Có văn bản thỏa thuận chuyển nhượng quyền sở hữu thuê bao, có sự chứng kiến của đại diện MobiFone;</li>\r\n<li>Có văn bản đồng ý của chủ sở hữu cũ về việc được quyền sở hữu giải thưởng phát sinh từ số thuê bao trúng thưởng CTKM này;</li>\r\n<li>Còn trong thời hạn trao thưởng của CTKM này;</li>\r\n<li>Các điều kiện khác đươc quy định tại thể lệ của CTKM này.</li>\r\n<li>Nếu không đáp ứng được các tiêu chuẩn trên, chủ sở hữu mới không được quyền nhận thưởng. Khi đó giải thưởng được coi là giải thưởng không có người nhận; ban tổ chức CTKM có trách nhiệm xử lý giải thưởng theo đúng quy định hiện hành.</li>\r\n</ul>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng Công ty Viễn thông MobiFone.</li>\r\n<li>Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.</li>\r\n<li>Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).</li>\r\n<li>Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.</li>\r\n<li>Thời hạn cuối cùng Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.</li>\r\n</ul>\r\n<p><strong>18. Trách</strong><strong> nhiệm thông báo:</strong></p>\r\n<ul>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone sẽ thông báo đầy đủ chi tiết nội dung của thể lệ chương trình khuyến mại, danh sách khách hàng trúng thưởng trên website chính thức của MobiFone và website của chương trình</li>\r\n</ul>\r\n<p><strong>19. Quy định khác </strong></p>\r\n<ul>\r\n<li>Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.</li>\r\n<li>Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.</li>\r\n<li>Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone và Tổng Công ty Viễn thông MobiFone được toàn quyền sử dụng thông tin cá nhân của khách hàng trúng giải (họ tên, tuổi, số điện thoại, địa chỉ, hình ảnh, giọng nói...) cho mục đích quảng cáo thương mại mà không phải trả chi phí.</li>\r\n<li>Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</li>\r\n</ul>', '', '', 'vn', 1);
INSERT INTO `cms_pages` (`id`, `slug`, `title`, `content`, `meta_keywords`, `meta_description`, `lang`, `enabled`) VALUES
(16, 'terms_6', 'Rinh Lộc Phát Tài 6', '<p align="center">&nbsp;</p>\r\n<p align="center"><strong>NỘI DUNG CHƯƠNG TRÌNH KHUYẾN MẠI</strong></p>\r\n<p align="center">&nbsp;</p>\r\n<p><strong>1. </strong> <strong> Tên chương trình khuyến mại: Rinh lộc phát tài – Giai đoạn 6 </strong></p>\r\n<p><strong>2. </strong> <strong>Hàng hoá, dịch vụ áp dụng khuyến mại: </strong> Gói Văn hóa, gói Du lịch</p>\r\n<p><strong>3. </strong> <strong>Thời gian</strong></p>\r\n<p>Từ 17h00 ngày 11/01/2018 đến 23h59:59 ngày 10/04/2018 (90 ngày)</p>\r\n<p><strong> Kết thúc CTKM, các gói cước sẽ được tiếp tục cung cấp cho khách hàng </strong></p>\r\n<p><strong>4. </strong> <strong>Đầu số dịch vụ: </strong> 678</p>\r\n<p><strong>5. </strong> <strong>Hình thức khuyến mại: </strong> Tích điểm trúng thưởng</p>\r\n<p><strong>6. </strong> <strong>Phạm vi khuyến mại: </strong> Toàn quốc</p>\r\n<p><strong>7. </strong> <strong>Địa chỉ website/wapsite: </strong> {cache}</p>\r\n<p><strong>8. </strong> <strong>Đối tượng và quy định </strong></p>\r\n<p>- Các thuê bao trả trước, trả sau đang hoạt động 02 chiều trên mạng MobiFone trong thời gian diễn ra chương trình khuyến mại.</p>\r\n<p>- Các thuê bao Fast Connect, MDT và thuê bao có chủ sở hữu là cán bộ, công nhân viên của Tổng công ty viễn thông MobiFone và Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone không được tham gia chương trình.</p>\r\n<p><strong>9. </strong> <strong>Cơ cấu giải thưởng </strong></p>\r\n<table class="table table-striped" border="1" width="100%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="8%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="22%">\r\n<p align="center"><strong>Loại giải</strong></p>\r\n</td>\r\n<td width="23%">\r\n<p align="center"><strong>Giải thưởng</strong></p>\r\n</td>\r\n<td width="16%">\r\n<p align="center"><strong>Đơn giá</strong></p>\r\n<p align="center"><strong>(VND)</strong></p>\r\n</td>\r\n<td width="10%">\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n<td width="18%">\r\n<p align="center"><strong>Thành tiền</strong></p>\r\n<p align="center"><strong>(VND)</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="22%">\r\n<p>Giải đồng hành</p>\r\n</td>\r\n<td width="23%">\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td width="16%">\r\n<p align="right">20.000</p>\r\n</td>\r\n<td width="10%">\r\n<p align="right">9.000</p>\r\n</td>\r\n<td width="18%">\r\n<p align="right">180.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="22%">\r\n<p>Giải tuần</p>\r\n<p>(05 giải/tuần)</p>\r\n</td>\r\n<td width="23%">\r\n<p>Thẻ nạp tiền MobiFone</p>\r\n</td>\r\n<td width="16%">\r\n<p align="right">500.000</p>\r\n</td>\r\n<td width="10%">\r\n<p align="right">65</p>\r\n</td>\r\n<td width="18%">\r\n<p align="right">32.500.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="22%">\r\n<p>Giải chung cuộc</p>\r\n<p>(1 giải/90 ngày)</p>\r\n</td>\r\n<td width="23%">\r\n<p>3 lượng vàng SJC 9999</p>\r\n</td>\r\n<td width="16%">\r\n<p align="right">37.000.000</p>\r\n</td>\r\n<td width="10%">\r\n<p align="right">3</p>\r\n</td>\r\n<td width="18%">\r\n<p align="right">111.000.000</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td colspan="4" width="71%">\r\n<p align="center"><strong>Tổng</strong></p>\r\n</td>\r\n<td width="10%">\r\n<p align="right"><strong>9.068</strong></p>\r\n</td>\r\n<td width="18%">\r\n<p align="right"><strong>323.500.000</strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align="right"><em>(Bằng chữ: </em> <em>Ba trăm hai mươi ba triệu, năm trăm nghìn đồng</em> <em>)</em></p>\r\n<p><em>Lưu ý: </em></p>\r\n<p>- <em>Thẻ nạp không quy đổi thành tiền mặt</em></p>\r\n<p>- <em>Sản phẩm hiện vật có thể quy đổi thành tiền mặt</em></p>\r\n<p><strong>10. </strong> <strong>Cách tham gia</strong></p>\r\n<p><strong><em>10.1. </em></strong> <strong> <em> Với các thuê bao đang tham gia CTKM Rinh lộc phát tài giai đoạn 5 </em> </strong></p>\r\n<p>- Khách hàng không cần đăng ký lại, hệ thống sẽ tự động gia hạn theo quy định hiện hành.</p>\r\n<p>- Hệ thống nhắn tin thông báo cho khách hàng duy trì thành công gói cước của dịch vụ, trường hợp thuê bao sử dụng nhiều gói cước chỉ nhận 1 tin thông báo: “ <em> CTKM Rinh loc phat tai duoc tiep tuc gia han tu ngay 11/01/2018 den ngay </em> <em>10/04/2018. Quy khach hay tiep tuc tham gia CTKM de co the so huu </em> <em>3 luong vang SJC. Chi tiet tai {cache}"</em></p>\r\n<p><strong><em>10.2. </em></strong> <strong> <em> Với các thuê bao chưa từng đăng ký hoặc đã đăng ký, nhưng hủy trước thời gian khuyến mại: </em> </strong></p>\r\n<p>Để tham gia CTKM, khách hàng có thể lựa chọn đăng ký gói cước Văn hóa theo một trong các cách sau:</p>\r\n<p>- <strong>Qua SMS:</strong> Soạn DK VH hoặc VH hoặc OK gửi 678</p>\r\n<p>- <strong>Qua USSD: </strong>Bấm *678#, phím gọi, sau đó nhấn 1 để đăng kí hoặc bấm *678*1#, phím gọi và làm theo hướng dẫn</p>\r\n<p>- <strong>Qua wapsite </strong></p>\r\n<p>+ Bước 1: Khách hàng bấm vào các banner quảng cáo về CTKM (nếu có)</p>\r\n<p>+ Bước 2: Khách hàng bấm đồng ý trên trang xác thực MobiFone <a href="http://dangky.mobifone.vn/">http://dangky.mobifone.vn</a></p>\r\n<p>- Sau khi đăng ký thành công, nếu khách hàng không hủy, chương trình sẽ tự động gia hạn hàng ngày gói cước.</p>\r\n<p><strong>11. </strong> <strong>Thông tin chi tiết về gói Văn hóa:</strong></p>\r\n<p>- <strong>Nội dung gói: </strong>Cung cấp các thông tin về văn hóa, phong tục tập quán dịp lễ tết của Việt Nam và các quốc gia trên thế giới kèm các câu hỏi trắc nghiệm liên quan.</p>\r\n<p>- <strong>Quyền lợi hàng ngày</strong><strong>:</strong></p>\r\n<p>+ Khách hàng được nhận bản tin của gói cước hàng ngày.</p>\r\n<p>+ Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</p>\r\n<p>- <strong>Các câu hỏi của gói:</strong></p>\r\n<p>+ Hàng ngày, khách hàng sẽ được nhận 05 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</p>\r\n<p>+ Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</p>\r\n<p>+ Thời gian trả lời câu hỏi không bị giới hạn</p>\r\n<p>+ Cước trả lời câu hỏi hoàn toàn miễn phí</p>\r\n<p>- <strong>Quy định về điểm tích lũy gói Văn hóa:</strong></p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="85%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="8%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="60%">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td width="30%">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center"><strong>I</strong></p>\r\n</td>\r\n<td width="60%">\r\n<p><strong> Trường hợp 1: Thuê bao gia hạn từ giai đoạn 05 sang giai đoạn 06 </strong></p>\r\n</td>\r\n<td width="30%">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">1.1</p>\r\n</td>\r\n<td width="60%">\r\n<p>Gia hạn thành công vào ngày 11/01/2018</p>\r\n</td>\r\n<td width="30%">\r\n<p align="center">100 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">1.2</p>\r\n</td>\r\n<td width="60%">\r\n<p>Điểm thưởng cho việc gia hạn thành công ngày 12/01/2018</p>\r\n</td>\r\n<td width="30%">\r\n<p align="center">2.000 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center"><strong>II</strong></p>\r\n</td>\r\n<td width="60%">\r\n<p><strong> Trường hợp thuê bao đăng ký lần đầu tiên </strong></p>\r\n</td>\r\n<td width="30%">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">2.1</p>\r\n</td>\r\n<td width="60%">\r\n<p>Đăng ký lần đầu tiên thành công</p>\r\n</td>\r\n<td width="30%">\r\n<p align="center">200 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p a