n được SMS mời tham gia sử dụng gói “Du lịch” của chương trình (sau khi trả lời xong câu hỏi thứ 2 hoặc câu hỏi thứ 5 của gói “Văn hóa”)</p>\r\n<p>- <strong>Quyền lợi hàng ngày:</strong></p>\r\n<p>+ Khi đăng ký hoặc gia hạn gói cước thành công, khách hàng sẽ nhận được điểm tích lũy và nhận được các câu hỏi trắc nghiệm miễn phí.</p>\r\n<p>+ Số điểm khách hàng tích lũy được từ gói Du lịch sẽ được xét các giải thưởng của chương trình.</p>\r\n<p>- <strong>Các câu hỏi của gói Du lịch:</strong></p>\r\n<p>+ Hàng ngày, khách hàng sẽ nhận được 03 câu hỏi trắc nghiệm liên quan đến chủ đề của chương trình. Trả lời các câu hỏi này, khách hàng được nhận điểm tích lũy cho mỗi câu trả lời với số điểm tương ứng với từng câu hỏi.</p>\r\n<p>+ Để trả lời câu hỏi, khách hàng soạn: 1 hoặc 2 gửi 678</p>\r\n<p>+ Thời gian trả lời câu hỏi không bị giới hạn</p>\r\n<p>+ Cước trả lời câu hỏi là hoàn toàn miễn phí</p>\r\n<p>- <strong>Quy định về điểm tích lũy gói Du lịch:</strong></p>\r\n<table class="table table-striped" border="1" width="83%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="10%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top" width="61%">\r\n<p align="center"><strong>Hoạt động tương tác</strong></p>\r\n</td>\r\n<td valign="top" width="27%">\r\n<p align="center"><strong>Điểm</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center"><strong>I</strong></p>\r\n</td>\r\n<td width="61%">\r\n<p><strong> Trường hợp 1: Thuê bao gia hạn từ giai đoạn 05 sang giai đoạn 06 </strong></p>\r\n</td>\r\n<td valign="top" width="27%">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center">1.1</p>\r\n</td>\r\n<td width="61%">\r\n<p>Gia hạn thành công ngày 11/01/2018</p>\r\n</td>\r\n<td valign="top" width="27%">\r\n<p align="center">1.000 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center"><strong>II</strong></p>\r\n</td>\r\n<td width="61%">\r\n<p><strong> Trường hợp 2: Thuê bao lần đầu tiên đăng ký </strong></p>\r\n</td>\r\n<td valign="top" width="27%">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center">2.1</p>\r\n</td>\r\n<td width="61%">\r\n<p>Đăng ký lần đầu tiên thành công</p>\r\n</td>\r\n<td valign="top" width="27%">\r\n<p align="center">2.000 điểm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center"><strong>III</strong></p>\r\n</td>\r\n<td width="61%">\r\n<p><strong>Tình huống chung</strong></p>\r\n</td>\r\n<td valign="top" width="27%">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center">3.1</p>\r\n</td>\r\n<td width="61%">\r\n<p>Đăng ký lại hoặc gia hạn thành công</p>\r\n</td>\r\n<td valign="top" width="27%">\r\n<p align="center">1.000 điểm/ngày</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center">3.2</p>\r\n</td>\r\n<td width="61%">\r\n<p>Trả lời câu hỏi đúng</p>\r\n</td>\r\n<td width="27%">\r\n<p align="center">100 điểm/câu</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="10%">\r\n<p align="center">3.3</p>\r\n</td>\r\n<td width="61%">\r\n<p>Trả lời câu hỏi sai</p>\r\n</td>\r\n<td width="27%">\r\n<p align="center">0 điểm/câu</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>- <strong>Giá cước gói Du lịch:</strong></p>\r\n<p>+ Mức cước 3.000 đồng/ngày (đã bao gồm VAT).</p>\r\n<p>+ Mọi thao tác khác của khách hàng khi tham gia chương trình: Đăng ký, hủy, tra cứu điểm...đều hoàn toàn miễn phí.</p>\r\n<p>+ Nếu khách hàng không hủy, gói cước sẽ được tự động gia hạn hàng ngày.</p>\r\n<p><strong>13. </strong> <strong>Quy</strong> <strong> định về 3 ngày miễn phí </strong></p>\r\n<p>- Mỗi thuê bao có 03 ngày trải nghiệm miễn phí đầu tiên cho gói ”Văn hóa”</p>\r\n<p>- Gói”Du lịch” không có 03 ngày trải nghiệm miễn phí.</p>\r\n<p>- 03 ngày đầu tiên được tính là 03 ngày đầu sử dụng mỗi gói cước và chỉ được áp dụng cho lần đăng ký đầu tiên. Trong thời gian miễn phí 03 ngày đầu tiên kể từ lần đầu tiên, nếu khách hàng hủy và đăng ký lại, khách hàng sẽ không bị trừ cước ở lần đăng ký tiếp theo.</p>\r\n<p>- Trong trường hợp khách hàng hủy trong thời gian 03 ngày miễn phí và đăng ký lại vào ngày thứ 4, khách hàng cũng sẽ không được hưởng nốt thời gian miễn phí còn lại của 03 ngày đầu tiên.</p>\r\n<p>- Trong thời gian miễn phí, khách hàng không bị tính cước và vẫn được duy trì các quyền lợi của gói cước.</p>\r\n<p>- Ngày được tính là một ngày theo lịch dương.</p>\r\n<p><strong>14. </strong> <strong>Mức cước và nguyên tắc trừ cước</strong></p>\r\n<p><strong><em>14.1. </em></strong> <strong><em>Khách hàng chỉ sử dụng gói cước </em></strong> <strong><em>Văn hóa</em></strong></p>\r\n<p>- Sau thời gian miễn phí, gói cước sẽ được tính phí theo nguyên tắc sau:</p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="106%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="7%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="34%">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 8h00 đến 20h00 </strong></p>\r\n</td>\r\n<td width="27%">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 20h01 đến 23h59 </strong></p>\r\n</td>\r\n<td width="30%">\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="34%">\r\n<p align="center">TKC ≥6.000 đồng</p>\r\n<p align="center"><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td width="27%">\r\n<p align="center">TKC ≥3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td width="30%">\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="34%">\r\n<p align="center">TKC &lt; 6.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="27%">\r\n<p align="center">TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="30%">\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong><em>14.2. </em></strong> <strong> <em>Khách hàng sử dụng cả 2 gói cước Văn hóa và Du lịch</em> </strong></p>\r\n<p>- Gói cước Văn hóa còn thời gian miễn phí:</p>\r\n<table class="table table-striped" border="1" width="630" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="36">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="229">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 8h00 đến 20h00 </strong></p>\r\n</td>\r\n<td width="187">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 20h01 đến 23h59 </strong></p>\r\n</td>\r\n<td width="94">\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td width="85">\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="36">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="229">\r\n<p align="center">TKC ≥3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td width="187">\r\n<p align="center">TKC ≥1.500 đồng</p>\r\n<p align="center"><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td width="94">\r\n<p align="center">Có</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="36">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="229">\r\n<p align="center">TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="187">\r\n<p align="center">TKC &lt; 1.500 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="94">\r\n<p align="center">Có</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>- Gói cước Văn hóa hết thời gian miễn phí:</p>\r\n<table class="table table-striped" border="1" width="102%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="7%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="36%">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 8h00 đến 20h00 </strong></p>\r\n</td>\r\n<td width="28%">\r\n<p align="center"><strong> Trạng thái tài khoản chính từ 20h01 đến 23h59 </strong></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center"><strong>Gia hạn gói Văn hóa</strong></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center"><strong>Gia hạn gói Du lịch</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="36%">\r\n<p align="center">TKC ≥9.000 đồng</p>\r\n<p align="center"><em>Trừ cước 9.000 đồng</em></p>\r\n</td>\r\n<td width="28%">\r\n<p align="center">TKC ≥4.500 đồng</p>\r\n<p align="center"><em>Trừ cước 4.500 đồng</em></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Có</p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="36%">\r\n<p align="center">6.000 đồng ≤ TKC &lt; 9.000 đồng</p>\r\n<p align="center"><em>Trừ cước 6.000 đồng</em></p>\r\n</td>\r\n<td width="28%">\r\n<p align="center">3.000 đồng ≤ TKC &lt; 4.500 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Có</p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="36%">\r\n<p align="center">3.000 đồng ≤ TKC &lt; 6.000 đồng</p>\r\n<p align="center"><em>Trừ cước 3.000 đồng</em></p>\r\n</td>\r\n<td width="28%">\r\n<p align="center">1.500 đồng ≤ TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Trừ cước 1.500 đồng</em></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Không</p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Có</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="7%">\r\n<p align="center">4</p>\r\n</td>\r\n<td width="36%">\r\n<p align="center">0 ≤ TKC &lt; 3.000 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="28%">\r\n<p align="center">0 ≤ TKC &lt; 1.500 đồng</p>\r\n<p align="center"><em>Không trừ cước</em></p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Không</p>\r\n</td>\r\n<td width="13%">\r\n<p align="center">Không</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong><em>14.3. </em></strong> <strong><em>Quy định chung</em></strong></p>\r\n<p>- Cước mỗi gói được cộng vào hoá đơn cước hàng tháng đối với thuê bao trả sau và được trừ vào tài khoản chính đối với thuê bao trả trước.</p>\r\n<p>- Tại thời điểm gia hạn, nếu tài khoản chính của khách hàng không đủ ở các mức cao hơn, hệ thống sẽ tính cước lại ở các mức thấp hơn tối đa 01 lần/ngày (các mức trừ cước được nêu chi tiết bên trên).</p>\r\n<p>- Trong một ngày, hệ thống chỉ tính cước gói tin khách hàng đã đăng ký theo 01 mức cước. Hệ thống không trừ bù cước trong cùng một ngày và trừ bù của các ngày trước đó</p>\r\n<p>- Nếu không trừ được cước của khách hàng trong vòng 30 ngày liên tiếp, hệ thống sẽ huỷ gói cước của khách hàng. Khách hàng có nhu cầu sử dụng dịch vụ phải đăng ký lại.</p>\r\n<p><strong>15. </strong> <strong>Quy định về việc sử dụng dịch vụ theo trạng thái thuê bao:</strong></p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="595" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top" width="47">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td valign="top" width="160">\r\n<p align="center"><strong>Trạng thái thuê bao</strong></p>\r\n</td>\r\n<td valign="top" width="387">\r\n<p align="center"><strong>Quy định </strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="160">\r\n<p>Khóa 01 chiều, 02 chiều</p>\r\n</td>\r\n<td width="387">\r\n<p>- Khách hàng tiếp tục sử dụng dịch vụ đến hết chu kỳ đó.</p>\r\n<p>- Tạm dừng cung cấp dịch vụ cho khách hàng trong các chu kỳ tiếp theo.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="160">\r\n<p>Mở lại các thuê bao khóa 01 chiều, 02 chiều</p>\r\n</td>\r\n<td width="387">\r\n<p>- TH1: Mở lại ngay trong chu kỳ cũ của gói dịch vụ =&gt; khách hàng tiếp tục sử dụng dịch vụ đến hết chu kỳ đó.</p>\r\n<p>- TH2: Mở lại khi chu kỳ cũ đã kết thúc =&gt; Hệ thống trừ cước thuê bao của khách hàng tính từ ngày mở lại đó:</p>\r\n<p>ü Trừ cước thành công: Khách hàng tiếp tục sử dụng dịch vụ.</p>\r\n<p>ü Trừ cước không thành công: Trừ cước lại theo quy định của dịch vụ.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="160">\r\n<p>Chuyển đổi giữa các thuê bao trả trước</p>\r\n</td>\r\n<td width="387">\r\n<p>Khách hàng tiếp tục sử dụng dịch vụ theo chu kỳ cũ.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">4</p>\r\n</td>\r\n<td width="160">\r\n<p>Chuyển đổi thuê bao trả trước sang trả sau và ngược lại</p>\r\n</td>\r\n<td width="387">\r\n<p>Khách hàng tiếp tục sử dụng dịch vụ theo chu kỳ cũ.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">5</p>\r\n</td>\r\n<td width="160">\r\n<p>Thuê bao bị hủy</p>\r\n</td>\r\n<td width="387">\r\n<p>Hủy dịch vụ.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong>16. </strong> <strong>Cách hủy gói cước:</strong></p>\r\n<p>- Để hủy một hoặc cả 2 gói cước: Soạn HUY gửi tới 678.</p>\r\n<p>- Khi hủy, toàn bộ các gói cước đang có sẽ bị hủy bỏ.</p>\r\n<p>- Sau khi hủy thành công, khách hàng sẽ không nhận được thông tin và quyền lợi của gói cước.</p>\r\n<p>- Nếu khách hàng tái đăng ký lại gói cước thì điểm số đã tích lũy trước đó sẽ được bảo lưu và cộng dồn.</p>\r\n<p><strong>17. </strong> <strong>Quy định về thời điểm tương tác</strong></p>\r\n<p>- Tất cả các thời điểm được quy định trong chương trình là thời điểm hệ thống dịch vụ ghi nhận giao dịch thành công, không tính theo thời điểm trên thiết bị của khách hàng</p>\r\n<p>- Ban tổ chức chương trình không chịu trách nhiệm về việc gửi, nhận tin nhắn bị chậm, các tương tác trên Website/wapsite bị chậm hoặc không thể thực hiện được do các sự cố kỹ thuật từ bên ngoài chương trình hoặc trên thiết bị của khách hàng.</p>\r\n<p><strong>18. </strong> <strong>Cách thức xếp hạng thuê bao trong CTKM:</strong></p>\r\n<p>Cuối mỗi chu kỳ xét thưởng (tuần/chung cuộc), chương trình sẽ xếp hạng thuê bao theo các tiêu chí có mức độ ưu tiên giảm dần như sau:</p>\r\n<p>- Tổng số điểm tích lũy của thuê bao trong chu kỳ đó theo thứ hạng từ cao xuống thấp.</p>\r\n<p>- Thời điểm đăng ký gói cước Văn hóa từ sớm nhất đến muộn nhất (tính từ ngày thuê bao đăng ký gần nhất ghi nhận trên hệ thống)</p>\r\n<p>- Thời điểm đạt được điểm cuối cùng vào ngày cuối của chu kì từ sớm nhất đến muộn nhất. Trong đó, ngày cuối cùng của chu kỳ được quy định như sau:</p>\r\n<p>+ Giải tuần: Áp dụng vào các ngày thứ 07 trong chu kỳ tuần, tính từ ngày đầu triển khai CTKM này. Riêng tuần cuối cùng là ngày thứ 06 chu kỳ tuần cuối cùng.</p>\r\n<p>+ Giải chung cuộc: Áp dụng với ngày cuối cùng của CTKM này.</p>\r\n<p>- Các thuê bao đã được đánh số theo thứ tự tăng dần, bắt đầu từ thuê bao có thành tích tốt nhất.</p>\r\n<p>- Ví dụ về bảng tổng sắp thứ tự thuê bao:</p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="91%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="16%">\r\n<p align="center"><strong>Thuê bao</strong></p>\r\n</td>\r\n<td width="26%">\r\n<p align="center"><strong>Điểm tích lũy trong chu kỳ</strong></p>\r\n</td>\r\n<td width="44%">\r\n<p align="center"><strong>Thời điểm đăng ký gói Văn hóa</strong></p>\r\n</td>\r\n<td width="12%">\r\n<p align="center"><strong>Xếp hạng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">A</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">1.000</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">12/11/2015 15:11:10</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">1</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">B</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">1.000</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">23/11/2015 20:11:10</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">2</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">C</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">1.000</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">28/01/2016 23:11:18</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">3</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">D</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">900</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">11/07/2016 23:56:18</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">4</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">E</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">900</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">18/07/2016 21:58:18</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">5</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="16%">\r\n<p align="center">F</p>\r\n</td>\r\n<td width="26%">\r\n<p align="center">800</p>\r\n</td>\r\n<td width="44%">\r\n<p align="center">19/09/2016 21:16:18</p>\r\n</td>\r\n<td width="12%">\r\n<p align="center">6</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p><strong>19. </strong> <strong>Cách thức xác định khách hàng trúng giải</strong></p>\r\n<p>- <strong>Giải chung cuộc: </strong>Được trao cho thuê bao xếp hạng thứ 99 trong toàn chương trình theo cách thức xếp hạng tại Mục 18 nêu trên.</p>\r\n<p>- <strong>Giải tuần: </strong>Đượctrao cho các thuê bao xếp hạng thứ 1, 18, 28, 38, 48 trong tuần theo cách thức xếp hạng tại Mục 18 nêu trên.</p>\r\n<p>Chú ý: 01 thuê bao chỉ được trúng giải 01 tuần duy nhất trong suốt CTKM. Nếu thuê bao đã trúng giải của tuần trước, đủ điều kiện trúng giải tuần khác, thì giải tuần đó sẽ được trao cho thuê bao xếp hạng liền sau.</p>\r\n<p>- <strong>Giải đồng hành: </strong></p>\r\n<p>Giải đồng hành áp dụng cho 100 thuê bao đăng ký mới mỗi ngày và thỏa mãn đủ 2 điều kiện sau:</p>\r\n<p>+ Thuộc nhóm các thuê bao đầu tiên đăng ký mới gói ”Văn hóa” trong ngày T (chỉ áp dụng với thuê bao lần tiên đăng ký gói Văn Hóa).</p>\r\n<p>+ Có trừ cước thành công gói ”Văn hóa” sau thời gian miễn phí (vào ngày T+3)</p>\r\n<p>+ Tần suất công bố danh sách trúng thưởng: 15 ngày/lần trên website chương trình.</p>\r\n<p><strong>20. </strong> <strong>Thời gian, Địa điểm và thủ tục trao thưởng:</strong></p>\r\n<p>- Sau khi có kết quả trúng thưởng, danh sách khách hàng trúng thưởng sẽ được đăng tải trên website chính thức của MobiFone và website của chương trình. Khách hàng có thể chủ động truy cập vào các địa chỉ trên để biết thông tin trúng thưởng.</p>\r\n<p>- Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ công bố công khai điểm số trúng thưởng. Các số điện thoại trúng thưởng sẽ được giấu 02 chữ số cuối, nhằm đảm bảo tính bảo mật cá nhân của người trúng giải.</p>\r\n<p><strong><em>20.1. </em></strong> <strong><em>Đối với giải thưởng bằng thẻ nạp tiền MobiFone:</em></strong> Giải thưởng sẽ được chuyển tới khách hàng thông qua hình thức nạp tiền trực tuyến</p>\r\n<p><strong><em>20.2. </em></strong> <strong><em>Đối với các khách hàng trúng giải chung cuộc:</em></strong></p>\r\n<p>- Hình thức nhận thưởng: Khách hàng trúng giải đến làm thủ tục nhận thưởng giải hiện vật tại các cửa hàng MobiFone trên toàn quốc hoặc các Chi nhánh của Trung tâm Dịch vụ Đa Phương tiện và Giá trị Gia tăng MobiFone. Giải chung cuộc có thể được quy đổi thành tiền. Giá trị quy đổi thành tiền được áp dụng tại thời điểm khách hàng nhận thưởng</p>\r\n<p>- Thông báo nhận thưởng: Trung tâm Dịch vụ Đa phương tiện và Giá trị Gia tăng MobiFone - Tổng công ty Viễn thông MobiFone sẽ thông báo cho khách hàng trúng thưởng theo các phương thức sau:</p>\r\n<p>+ Gọi điện thoại thông báo cho khách hàng từ một trong các số điện thoại sau:</p>\r\n<p>ü 028.3962 1501/028.3962 1502</p>\r\n<p>ü 0236.3848 999</p>\r\n<p>ü 024.3782 3151</p>\r\n<p>+ Tần suất và thời gian gọi điện thoại tối đa cho một thuê bao như sau: 03 lần một ngày trong 5 ngày làm việc liên tục, trong khoảng thời gian từ 8h00 tới 20h00.</p>\r\n<p>+ Nhắn tin từ đầu số 090 với nội dung: “<em>MobiFone chúc mừng quý khách đã trúng thưởng giả</em><em>i Chung cuộc- CTKM </em> <em>Rinh Lộc Phát Tài. Quý khách truy cập website </em> <a href="{cache}/"> <em>{cache}</em> </a> <em> để biết chi tiết”</em></p>\r\n<p>- Khách hàng trúng thưởng cần chuẩn bị các giấy tờ sau để làm thủ tục nhận thưởng:</p>\r\n<p>+ Trường hợp thuê bao đứng tên cá nhân:</p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="595" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="47">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="255">\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td width="217">\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td width="76">\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2" width="47">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2" width="255">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="217">\r\n<p>Bản gốc</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="255">\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td width="217">\r\n<p>SIM đăng ký thông tin cá nhân chính chủ của người nhận giải</p>\r\n</td>\r\n<td width="76">\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>+ Trường hợp thuê bao đứng tên tổ chức:</p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="604" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="47">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="255">\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td width="217">\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td width="85">\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2" width="47">\r\n<p align="center">1</p>\r\n</td>\r\n<td rowspan="2" width="255">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người đến làm thủ tục</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="217">\r\n<p>Bản gốc</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">2</p>\r\n</td>\r\n<td width="255">\r\n<p>Giấy đăng ký kinh doanh/hoạt động hoặc tương đương của tổ chức sở hữu thuê bao</p>\r\n</td>\r\n<td width="217">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="47">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="255">\r\n<p>Sim Điện thoại chứa số thuê bao trúng giải</p>\r\n</td>\r\n<td width="217">\r\n<p>SIM đăng ký thông tin của tổ chức trúng thưởng</p>\r\n</td>\r\n<td width="85">\r\n<p align="center">01 chiếc</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>+ Trường hợp khách hàng không trực tiếp đến làm thủ tục, ủy quyền cho người khác đến làm thay. Khi đến làm việc, người được ủy quyền cần mang các giấy tờ sau:</p>\r\n<div align="center">\r\n<table class="table table-striped" border="1" width="97%" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="8%">\r\n<p align="center"><strong>STT</strong></p>\r\n</td>\r\n<td width="42%">\r\n<p align="center"><strong>Giấy tờ</strong></p>\r\n</td>\r\n<td width="34%">\r\n<p align="center"><strong>Quy cách</strong></p>\r\n</td>\r\n<td width="14%">\r\n<p align="center"><strong>Số lượng</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">1</p>\r\n</td>\r\n<td width="42%">\r\n<p>Giấy ủy quyền đi làm thủ tục nhận giải</p>\r\n</td>\r\n<td width="34%">\r\n<p>Bản gốc có chữ ký của người ủy quyền, người được ủy quyền và xác nhận của chính quyền địa phương nơi cư trú</p>\r\n</td>\r\n<td width="14%">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan="2" width="8%">\r\n<p align="center">2</p>\r\n</td>\r\n<td rowspan="2" width="42%">\r\n<p>Chứng minh thư (hoặc hộ chiếu) còn thời hạn của người được ủy quyền</p>\r\n</td>\r\n<td width="34%">\r\n<p>Bản phô tô công chứng</p>\r\n</td>\r\n<td width="14%">\r\n<p align="center">02 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="34%">\r\n<p>Bản gốc</p>\r\n</td>\r\n<td width="14%">\r\n<p align="center">01 bản</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td width="8%">\r\n<p align="center">3</p>\r\n</td>\r\n<td width="42%">\r\n<p>Các giấy tờ khác của người ủy quyền như trường hợp người đó trực tiếp làm thủ tục</p>\r\n</td>\r\n<td width="34%">&nbsp;</td>\r\n<td width="14%">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>- Vào thời điểm nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động 2 chiều và có thông tin cá nhân trùng với thông tin thuê bao đã đăng ký với Tổng Công ty Viễn thông MobiFone.</p>\r\n<p>- Sau thời điểm công bố trúng thưởng, nếu khách hàng chuyển quyền sở hữu số thuê bao trúng thưởng cho nhau, thì chủ sở hữu thuê bao cũ (trước thời điểm chuyển quyền) không được quyền nhận thưởng; chủ sở hữu mới (sau thời điểm chuyển quyền) khi đó được quyền nhận thưởng nếu đáp ứng đầy đủ các điều kiện sau:</p>\r\n<p>+ Có sở hữu thẻ SIM chứa số thuê bao trúng giải;</p>\r\n<p>+ Có văn bản thỏa thuận chuyển nhượng quyền sở hữu thuê bao, có sự chứng kiến của đại diện MobiFone;</p>\r\n<p>+ Có văn bản đồng ý của chủ sở hữu cũ về việc được quyền sở hữu giải thưởng phát sinh từ số thuê bao trúng thưởng CTKM này;</p>\r\n<p>+ Còn trong thời hạn trao thưởng của CTKM này;</p>\r\n<p>+ Các điều kiện khác đươc quy định tại thể lệ của CTKM này.</p>\r\n<p>+ Nếu không đáp ứng được các tiêu chuẩn trên, chủ sở hữu mới không được quyền nhận thưởng. Khi đó giải thưởng được coi là giải thưởng không có người nhận; ban tổ chức CTKM có trách nhiệm xử lý giải thưởng theo đúng quy định hiện hành.</p>\r\n<p>- Tại thời điểm làm thủ tục nhận thưởng, số thuê bao trúng thưởng phải đang ở trạng thái hoạt động cả 2 chiều và có thông tin cá nhân trùng khớp với thông tin đăng ký trên hệ thống của Tổng Công ty Viễn thông MobiFone.</p>\r\n<p>- Trường hợp khách hàng chuyển đổi hình thức sử dụng cho số thuê bao trúng giải (giữa các dịch vụ trả trước, từ trả sau sang trả trước hoặc ngược lại) thì giải thưởng vẫn được giữ nguyên.</p>\r\n<p>- Tại thời điểm làm thủ tục nhận thưởng, cá nhân nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho cá nhân đó; hoặc tổ chức nào đứng tên sở hữu số thuê bao trúng thưởng, giải thưởng sẽ được trao cho tổ chức đó (Ban tổ chức không can thiệp vào việc xử lý giải thưởng của tổ chức với đại diện sử dụng thuê bao trúng thưởng).</p>\r\n<p>- Trong vòng 30 ngày kể từ ngày kết thúc chương trình khuyến mại, nếu khách hàng trúng thưởng không đến làm thủ tục nhận thưởng với bất cứ lý do nào, thì khách hàng đó sẽ không được nhận thưởng. Giải thưởng khi đó được coi là giải thưởng tồn đọng.</p>\r\n<p>- Thời hạn cuối cùng Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone (đơn vị tổ chức chương trình) có trách nhiệm trao thưởng cho khách hàng là 30 ngày kể từ ngày kết thúc chương trình khuyến mại.</p>\r\n<p><strong>21. </strong> <strong>Quy định khác </strong></p>\r\n<p>- Khách hàng trúng thưởng phải chịu chi phí đi lại, ăn ở cho việc nhận thưởng của mình.</p>\r\n<p>- Khách hàng trúng thưởng phải nộp thuế thu nhập không thường xuyên (nếu có) và các loại thuế khác liên quan đến việc nhận giải thưởng tiền mặt và hiện vật theo quy định của pháp luật hiện hành.</p>\r\n<p>- Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone và Tổng Công ty Viễn thông MobiFone được toàn quyền sử dụng thông tin cá nhân của khách hàng trúng giải (họ tên, tuổi, số điện thoại, địa chỉ, hình ảnh, giọng nói...) cho mục đích quảng cáo thương mại mà không phải trả chi phí.</p>\r\n<p>- Trong trường hợp xảy ra tranh chấp liên quan đến chương trình khuyến mại này, Công ty Cổ phần Dịch vụ Kỹ thuật MobiFone có trách nhiệm trực tiếp giải quyết, nếu không thỏa thuận được tranh chấp sẽ được xử lý theo quy định của pháp luật hiện hành.</p>', '', '', 'vn', 1),
(17, 'winners', 'Lộc Vàng Xuân Mới', '<h3>DANH SÁCH THUÊ BAO TRÚNG THƯỞNG CTKM LỘC VÀNG ĐÓN XUÂN</h3>\r\n<p class="well alert-warning text-center">MobiFone xin chúc mừng những khách hàng đã may mắn trúng các giải của Chương trình khuyến mại "Lộc vàng đón xuân"<br>(Từ 15:00:00 ngày 18/11/2015 đến 23:59:59 ngày 15/02/2016)</p>\r\n<table class="table" cellspacing="0" cellpadding="0" align="center">\r\n<thead>\r\n<tr><th align="center"><strong>STT</strong></th><th align="center"><strong>Số điện thoại</strong></th><th align="center"><strong>Mã số</strong></th><th align="center"><strong>Tên giải thưởng</strong></th><th align="center"><strong>Giải thưởng (đồng)</strong></th></tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td align="center">1</td>\r\n<td align="center">8412196687xx</td>\r\n<td align="center">000000003151768</td>\r\n<td align="center">Giải nhì</td>\r\n<td align="center">60.000.000</td>\r\n</tr>\r\n<tr>\r\n<td align="center">2</td>\r\n<td align="center">849383821xx</td>\r\n<td align="center">000000010521299</td>\r\n<td align="center">Giải đặc biệt</td>\r\n<td align="center">1.500.000.000</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', '', 'vn', 1);
